(4, 'https://www.nbcsports.com/', 'NBC Sports | Live Streams, Video, News, Schedules, Scores and more', '', 'Top News', 'On the clock Breaking down Briscoe\'s emotional Darlington win Possible NBA timeline has games start July 15 Top Videos Simms: Murray, Lock will be most improved QBs Carlson on potential playoff format: \'24 teams sounds like a lot\' NASCAR on NBC Sports What\'s next for NASCAR? NHL News NHLPA Executive Board voting on 24-team Stanley Cup playoff format Premier League News Man United release latest financial results New house, new Rhule NBA News Adam Silver wants full seven-game playoff series in every round MLB News Tensions rising between MLB, Players Association IndyCar on NBC Sports IndyCar cancels Richmond, Toronto; makes Road America a doubleheader Chris Simms Unbuttoned Look out for Cowboys to crash playoffs in 2020 Golf Channel Adam Scott skeptical of Tour\'s Health and Safety Plan College Football News What would socially distant Shoe look like? College Basketball News Most important stay-or-go decisions Home of the Olympic Channel Watch: Livestream of the Olympic Channel Chen weighs unknown variables of figure skating season IOC preps for different scenarios for Tokyo Olympics in 2021 Golf Channel Latest New Texas resident Brandon Wu takes down Scottie Scheffler to win Maridoe 2.0 title As Tiger Woods covered his face in victory, so too did so many others in de... Kevin Na believes Tiger Woods will captain the 2022 U.S. Ryder Cup team', '', '', '', 'NBCS-Logo WatchNFLNHLNBAMLBSoccerNASCARMotorsGolfNCAA BKOlySkatingNCAA FBHorsesRugbyDog ShowNBC Sports BetAA BowlPLLTennisCyclingMMANBC Sports Gold MORE NBC Sports Gold Odds App rotoworld Tickets Newsletters sports engine Search Watch now View full schedule Live Upcoming Events No Events at this time Top News On the clock Mike Florio and Big Cat break down the reports surrounding Dak Prescott and the Cowboys and explain why July 15th is the date to watch. AP Photo Breaking down Briscoe\'s emotional Darlington win The NASCAR America crew looks at Chase Briscoe\'s emotional Xfinity Series win, how he held off Kyle Busch and how his victory goes beyond the track. Possible NBA timeline has games start July 15 At this point June 21 and July 15 are not set in stone, but they serve as a good marker for what the NBA is thinking. Top Videos 4:22 Simms: Murray, Lock will be most improved QBs There are plenty of young QBs in the NFL landscape, but Chris Simms believes Kyler Murray and Drew Lock are the two quarterbacks who will improve the most in 2020. 0:54 Carlson on potential playoff format: \'24 teams sounds like a lot\' Capitals\' John Carlson understands why the logistics may dictate having a 24-team playoff, but that doesn\'t mean he likes the idea. NASCAR on NBC Sports What\'s next for NASCAR? With NASCAR running races on weekdays, inverting the field in some races and not having practice, what other changes might be tried this season? NHL News NHLPA Executive Board voting on 24-team Stanley Cup playoff format We could know as early as Friday evening what the NHLPA thinks of the proposed 24-team, conference-based Stanley Cup playoff format. Premier League News Man United release latest financial results Man United reveal latest financial results as the coronavirus has hit one of the richest clubs on planet hard. New house, new Rhule Matt Rhule\'s Panthers face a tall task with a new coach, new coordinators, and new QB, but they\'ve already hit the ground running  from a distance. NBA News Adam Silver wants full seven-game playoff series in every round \"Whoever wins the title is not putting an asterisk on the banner they raise to the rafters.\" MLB News Tensions rising between MLB, Players Association The money negotiation hasn\'t even started, but strategic leaks from Major League Baseball to the press have angered the players IndyCar on NBC Sports IndyCar cancels Richmond, Toronto; makes Road America a doubleheader The IndyCar NTT Series canceled its 2020 races at Richmond and Toronto because of COVID-19 restrictions and moved Road America to July as a doubleheader. Chris Simms Unbuttoned 3:48 Look out for Cowboys to crash playoffs in 2020 After missing out on the playoffs in 2019, the Dallas Cowboys have reloaded in the offseason and could be ready to make a deep run. Golf Channel Adam Scott skeptical of Tour\'s Health and Safety Plan They are being fairly thorough, but my initial reaction was I was surprised it wasn\'t tighter than it is, Scott told the Australian Associated Press. College Football News 4:54 What would socially distant Shoe look like? Mike Florio and Chris Simms break down college stadium logistics after Ohio State AD Gene Smith talked about how many fans the school could fit into the Shoe under social distancing guidelines. College Basketball News Most important stay-or-go decisions These are the 12 most important decisions left to be made. Home of the Olympic Channel Watch: Livestream of the Olympic Channel Chen weighs unknown variables of figure skating season IOC preps for different scenarios for Tokyo Olympics in 2021 Golf Channel Latest New Texas resident Brandon Wu takes down Scottie Scheffler to win Maridoe 2.0 title As Tiger Woods covered his face in victory, so too did so many others in de... Kevin Na believes Tiger Woods will captain the 2022 U.S. Ryder Cup team Top Headlines NBA Commissioner Silver wants seven-game series in every playoff round NHLPA Executive Board voting on 24-team Stanley Cup playoff format IndyCar cancels Richmond, Toronto; makes Road America doubleheader Brady texted Payton about Week 1 game: \'Youre the favorites\' Rams\' Donald: I dont see how you could play a game without fans Source: Growing support in NFL for 4th-and-15 alternative to onside kicks Briscoe holds off Ky. Busch to win Darlington Xfinity race Marvin Lewis says draft incentive plan was offensive: \'It was like having Jim Crow laws\' FOLLOW US Facebook Twitter Instagram NBC Sports Social Directory