(10, 'https://www.skysports.com/football/news/11671/11991234/evertons-25-years-without-silverware-no-luck-little-money-and-lack-of-belief-but-carlo-ancelotti-can-turn-around-fortunes', 'Everton\'s 25 years without silverware: No luck, little money and lack of belief... but Carlo Ancelotti can turn around fortunes | Football News | Sky Sports', 'Everton\'s 25 years without silverware: No luck, little money and lack of belief... but Carlo Ancelotti can turn around fortunes', 'Football Sky Sports News presenter Julian Warren spoke to Leon Osman, Paul Rideout and Graham Stuart about Everton\'s quest to end a 25-year trophy drought', 'Premier League News By Julian Warren, Sky Sports News presenter Also See: Super 6: Dortmund to keep heat on Bayern? Trending', '', 'More from Football', '', 'Search Football Premier League Everton News News News Select a team All Teams Arsenal Aston Villa Bournemouth Brighton Burnley Chelsea Crystal Palace Everton Leicester City Liverpool Manchester City Manchester United Newcastle United Norwich City Sheffield United Southampton Tottenham Hotspur Watford West Ham United Wolverhampton Barnsley Birmingham City Blackburn Rovers Brentford Bristol City Cardiff City Charlton Athletic Derby County Fulham Huddersfield Town Hull City Leeds United Luton Town Middlesbrough Millwall Nottingham Forest Preston North End Queens Park Rangers Reading Sheffield Wednesday Stoke City Swansea City West Bromwich Albion Wigan Athletic Accrington Stanley AFC Wimbledon Blackpool Bolton Wanderers Bristol Rovers Burton Albion Coventry City Doncaster Fleetwood Town Gillingham Ipswich Town Lincoln City Milton Keynes Dons Oxford United Peterborough United Portsmouth Rochdale Rotherham United Shrewsbury Town Southend United Sunderland Tranmere Rovers Wycombe Wanderers Bradford City Cambridge United Carlisle United Cheltenham Town Colchester United Crawley Town Crewe Alexandra Exeter City Forest Green Rovers Grimsby Town Leyton Orient Macclesfield Town Mansfield Morecambe Newport County Northampton Town Oldham Athletic Plymouth Argyle Port Vale Salford City Scunthorpe United Stevenage Swindon Town Walsall Aberdeen Celtic Hamilton Academical Heart of Midlothian Hibernian Kilmarnock Livingston Motherwell Rangers Ross County St Johnstone St Mirren Athletic Bilbao Atletico Madrid Barcelona CD Leganes Celta Vigo Deportivo Alaves Eibar Espanyol Getafe Granada Levante Osasuna Real Betis Real Madrid Real Mallorca Real Sociedad Real Valladolid Sevilla Valencia Villarreal AC Milan Atalanta Bologna Brescia Cagliari Fiorentina Genoa Hellas Verona Inter Milan Juventus Lazio Lecce Napoli Parma Roma Sampdoria Sassuolo Spal Torino Udinese Bayer Leverkusen Bayern Munich Borussia Dortmund Borussia Monchengladbach Cologne Eintracht Frankfurt FC Augsburg FC Schalke 04 Fortuna Dusseldorf FSV Mainz 05 Hertha Berlin RB Leipzig SC Freiburg SC Paderborn 07 TSG Hoffenheim Union Berlin Werder Bremen Wolfsburg Amiens SC Angers Brest Dijon FC Metz Girondins Bordeaux Lille Monaco Montpellier Nantes Nice Nimes Olympique Lyonnais Olympique Marseille Paris Saint-Germain RC Strasbourg Reims St Etienne Stade Rennes Toulouse ADO Den Haag Ajax AZ Alkmaar FC Emmen FC Groningen FC Twente FC Utrecht Feyenoord Fortuna Sittard Heerenveen Heracles Almelo PEC Zwolle PSV Eindhoven RKC Waalwijk Sparta Rotterdam Vitesse Arnhem VVV Venlo Willem II Tilb Albania Algeria Argentina Australia Austria Belgium Bolivia Bosnia-Herzegovina Brazil Cameroon Chile Colombia Costa Rica Croatia Czech Republic Denmark Ecuador Egypt England Estonia France Germany Ghana Greece Honduras Hungary Iceland Iran Italy Ivory Coast Jamaica Japan Korea DPR Korea Republic Mexico Montenegro Morocco Netherlands New Zealand Nigeria Northern Ireland Panama Paraguay Peru Poland Portugal Republic of Ireland Romania Russia Saudi Arabia Scotland Senegal Serbia Slovakia Slovenia South Africa Spain Sweden Switzerland Tunisia Turkey Ukraine Uruguay USA Venezuela Wales England Germany Holland Israel Italy Norway Russia Spain Angola Burkina Faso Cape Verde Congo DR Ethiopia Mali Niger Nigeria Togo Zambia Teams Video Fixtures Results Tables Stats Squad Transfers Sky Bet Super 6 More from Football Football Home Premier League Everton\'s 25 years without silverware: No luck, little money and lack of belief... but Carlo Ancelotti can turn around fortunes Sky Sports News presenter Julian Warren spoke to Leon Osman, Paul Rideout and Graham Stuart about Everton\'s quest to end a 25-year trophy drought By Julian Warren, Sky Sports News presenter Last Updated: 20/05/20 8:56am Carlo Ancelotti will seek to end Everton\'s barren run in his first full season It\'s 25 years to the day since Everton last won a trophy. A silver anniversary of no silverware. May 20, 1995 - a 1-0 win over Manchester United in the FA Cup final. Everton\'s Dogs of War relived: 25 years on Coleman leading the way as Everton captain Digne: Everton can reach CL with Ancelotti John Major was Prime Minister, Robson and Jerome topped the charts, Richarlison wasn\'t even born. 9,132 days later, Evertonians are still waiting for another day like that. A fanbase starved of success, but it wasn\'t always that way. Growing up as a Blue in the \'80s, I assumed we\'d always be playing in finals and winning titles. I jumped on the bandwagon as a six-year-old in 1985, the club\'s finest hour as we won the League and European Cup Winners\' Cup. Only a Norman Whiteside goal in extra-time in the FA Cup final denied us a treble. 21:45 Everton\'s famous 1995 FA Cup win over Manchester United, revisited on its 25th anniversary by two men who made it possible, Paul Rideout and Graham Stuart. Everton\'s famous 1995 FA Cup win over Manchester United, revisited on its 25th anniversary by two men who made it possible, Paul Rideout and Graham Stuart. A year later we were back at Wembley, beaten this time by Liverpool, my first taste of heart-breaking defeat to our biggest rivals. Yes, there have been one or two more since! Twelve months later, my dad took me to Goodison Park for the first time and we were champions again. You could call me a glory hunter. There\'s not been much glory since. \"It\'s very hard to accept as an ex-player and as a supporter that we haven\'t been close enough and won anything in 25 years,\" former striker Graham Stuart told Sky Sports. He\'s now a club ambassador but played in the 1995 final and might\'ve scored the winner too, had he not hit the bar from close-range. Thankfully, Paul Rideout was in the right place at the right time to head in the only goal of the game. \"There\'s not many of us that can do that, play a one-two off the bar for your strike partner! Paul set me up in the semi-final so it was only right I set him up in the final. Match-winner Paul Rideout celebrates his strike in the first half at Wembley \"I was only eight yards out, and in some respects I connected too well, they\'re the ones that if you scuff it they dribble into the bottom corner. It hit the underside of the bar but thankfully Paul saved my blushes. But at the time I didn\'t care, you\'ve won an FA Cup final and that\'s all that matters.\" Now based in the USA, Rideout\'s dined out on that goal ever since, even if most of the kids he coaches in Arizona have no knowledge of what he achieved before they were born. \"Sometimes they come in with their phones and their parents have looked me up, and they come and show me it and you talk to them about it. Matchday hero Rideout with Neville Southall after victory in 1995 at Wembley \"I have lived off it for 25 years and that\'s all thanks to Graham, he set it up. The sad part is my celebration afterwards, not knowing what to do, it was a sad celebration! But when you score at Wembley it\'s a special place.\" For the record, Rideout\'s celebration consisted of running away to the Everton fans with two hands in the air before blowing a kiss. True, there was no Duncan Ferguson shirt-waving or Tim Cahill-esque corner flag boxing, but I\'ve seen worse! Everton have been back to Wembley for just one Cup final since, in 2009. Louis Saha scored after just 25 seconds, the fastest goal in an FA Cup final. I remember turning to my mate once the celebrations had calmed down and saying \"we\'ve scored too early\". Louis Saha gave Everton the perfect start with the fastest FA Cup final goal A pessimism and \'it\'s bound to go wrong\' attitude has developed over the years. Sadly, I was right. We lost 2-1. Leon Osman felt the pain more than most in the team that day, having been at the club since he was a lad. At the age of 14, he\'d signed schoolboy terms in Joe Royle\'s office days before the 1995 final. \"I\'ve not been able to look back on it and watch, it was just such a disappointing day in my career with the hype around it and you know what could be possible at the end of it\". It\'s that possibility, that opportunity for overnight hero status with the fans that awaits every Everton team at the start of each new season - can they be the ones to bring silverware back to Goodison? Of course, qualifying for the Champions League - as they did under David Moyes in 2005 - would be a giant step forward and re-establish the club on the European football map but you can\'t put fourth place in the trophy cabinet. So why have trophies eluded the club in an era when Leicester have won the Premier League with a squad assembled for just over 50m and Wigan, Swansea and Portsmouth have all won cups at Wembley? Everton manager David Moyes looks dejected after the 2009 FA Cup final \"If it was as simple as one reason I\'m pretty sure it would\'ve been figured and changed,\" Osman told Sky Sports. \"In the past, the club struggled for a bit of money, they were fighting for relegation for years rather than at the top of the table. And with all that came a lack of belief. We were getting to cup finals and semi-finals and we just lacked that real belief to get that first trophy won. \"To be an Evertonian and have Liverpool winning trophies is hard to take, knowing I was one of the people who could do something about it and for whatever reason was unable to do so. You feel the burden, you feel the disappointment and I hope as soon as possible this next generation of players can bring a trophy to Goodison Park.\" Defeat in the FA Cup semi-final to Liverpool in 2012 was especially painful Everton do have money now, thanks to the financial muscle of their billionaire major shareholder Farhad Moshiri. He has spent around 450m on players since his arrival in 2016 and yet in the three completed seasons since, Everton finished no higher than eighth in the Premier League and won just four cup ties, progressing no further than the fourth round. So, is it really all about the money? \"It\'s luck at times,\" Osman added. \"The season before 2009 Portsmouth had got to the final against Cardiff, but when we got to the semi-finals it was Chelsea, Manchester United and Arsenal. We got to the semis in 2012 and it was top four sides again. We just kept finding ourselves having that good run when the top sides were desperate to win trophies themselves that season.\" Manchester United scored a last-minute winner in 2016\'s FA Cup semi-final But as Evertonians know only too well, we\'ve been our own worst enemy at times too. You only have to go back to January to see that, when Jurgen Klopp put out the Liverpool kids in the FA Cup third round, but we still lost. The wait for a win at Anfield - another millstone around our neck - goes on. Twenty years and counting. That defeat was just a few weeks into the reign of the latest manager brought in to try and bring the good times back to Goodison Park. With the club 16th in the table at the time, Carlo Ancelotti\'s appointment was seen as a major coup. The dapper Italian is a silver-haired silverware specialist who\'s won trophies in five different countries (including England with Chelsea) and three Champions League titles - but is he the man to reignite Everton\'s fortunes? Two of the class of \'95 certainly think so. The Gwladys Street faithful have instantly warmed to their new manager \"We couldn\'t have anybody better than Carlo,\" Stuart told Sky Sports. \"He knows how to put a good side together, he won\'t suffer fools, he commands respect but we\'ve got to give him a bit of time.\" Rideout agrees. \"He reminds me a bit of Joe Royle in the way he\'s calm. I think he\'ll be great for the younger players. He\'s done it on and off the field at great big clubs, his reputation is superb so he\'s got the respect of the players straight away. Also See: Everton\'s Dogs of War relived: 25 years on Digne: Everton can reach CL with Ancelotti Everton transfer rumours Everton refund fans for remaining games \"I think he\'ll have the ability to bring in top players just because of his name. Everton is a huge club, it\'s a giant of a club, it doesn\'t matter how good or bad, the consistency of the fans is the same. I think it will go on to great things\". Like all Evertonians, I really hope he\'s right. Super 6: Dortmund to keep heat on Bayern? Super 6 is back. Do not miss your chance to land the 50,000 jackpot. Play for free, entries by 2:30pm. Trending 1 Pippen \'beyond livid\' with Jordan over Last Dance 2 Ancelotti: Zidane changed my ideas on football 3 Neville: Premier League should save EFL clubs 4 Who is the PL\'s greatest wonderkid? 5 Barton feels sorry for Sunderland over play-offs 6 Liverpool chairman: It\'s important to finish PL season 7 Button, McLaren back Sainz to be Ferrari hit 8 Leeds chief: \'National embarrassment\' if season unfinished 9 San Siro demolition moves step closer 10 Arsenal\'s squad assessed: Stay or go? Video Latest News Home Sports Football F1 Cricket Rugby Union Rugby League Golf Boxing Olympics Tennis Racing Darts NFL NBA Netball GAA MMA More Sports Scores Video TV Sky Bet Games More Transfer Centre Live on Sky Get Sky Sports TV Shows TV Guide Competitions Sky Go Now TV Sports Scholarships Tackling Racism Pod