(16, 'https://bleacherreport.com/articles/2891684-5-lower-league-footballers-who-could-play-for-the-premier-league-top-6', '5 Lower League Footballers Who Could Play for the Premier League Top 6 | Bleacher Report | Latest News, Videos and Highlights', '5 Lower League Footballers Who Could Play for the Premier League Top 6 Related', '', 'Report: PSG Make $65M Bid for Icardi Report: PSG Make $65M Bid for Icardi Potential Premier League Bargains  Potential Premier League Bargains  Report: Pjanic Told PSG \'I Only Want Barca\' Report: Pjanic Told PSG \'I Only Want Barca\' Is Ferguson Football\'s Closest Thing to Jordan? Is Ferguson Football\'s Closest Thing to Jordan?', '', '', '', 'Bleacher Report Logo NFL NBA CFB World Football MLB NHL CBB MMA WWE Golf Tennis Boxing B/R Shop More Shows B/R Kicks B/R Live Mag Get the App B/R Shop Sign Up Login Facebook Logo Twitter Logo Copy Link Icon World Football 5 Lower League Footballers Who Could Play for the Premier League Top 6Sam Tighe@@stighefootball Twitter LogoWorld Football Tactics Lead WriterMay 22, 20201 Comment Comment Bubble Icon Marc Atkins/Getty Images As you\'ve no doubt heard by now, the coronavirus is going to have a severe impact on football finances and, most notably for fans, the transfer market. B/R\'s Dean Jones has done extensive reporting on this, relaying the thoughts of chairmen, executives and managers who all agree cash is going to be short, wages are going to have to drop and that perhaps football\'s bubble has burst; that an unsustainable business is now going to undergo a hard reset. Even superclubs are affected. Manchester United\'s pursuit of Jadon Sancho has turned into a patient waiting game, Arsenal are going to have to get even more creative with their budget, while Barcelona are staring financial peril in the face. One method mooted to help cope with the cash shortage is player swap dealssomething we saw an increase in during the 2019 summer transfer window, and that could become even more common in 2020. Another is looking down the leagues. The clubs further down the football pyramid will be affected even more than those at the top, so not only could looking in their direction be a good way of securing homegrown talent for a lower price, but the wages may be more manageable too. It\'s a point alluded to by Ben Lyttleton, author of Edge: What Business Can Learn From Football, in B/R\'s look at Barcelona\'s finances this week: \"There will be more opportunities for clubs to give younger players a chance to keep the wage bills down. We\'ll see clubs trying to move on players with good deals. We\'ll see more swap deals, more loans. There will be a change in how the market will operate. There will be opportunities for smart clubs to find value.\" So let\'s cast our eyes down the English leagues and hunt for those potential gems. The next Dele Allis, if you will. We\'ve enlisted Round World Royals director Harry Brooks, an independent coach who has worked personally with several players in the lower leagues, in addition to more established names, such as Steven Bergwijn. He\'s helped assess five players from England\'s lower leagues that could step up to a top-six Premier League level, adding some suggested good fits along the way. Kalvin Phillips, 24, Defensive Midfielder, Leeds United James Gill - Danehouse/Getty Images Ever since Marcelo Bielsa was appointed Leeds United manager, player success stories have come thick and fast. Almost everyone has improved immeasurably under his tutelage, with Phillips perhaps the shiniest example of them all. A snappy, aggressive, athletic midfielder, his presence in the centre of the park goes a long way to making Leeds an uncomfortable opponent to play against. He racks up the tackles and interceptions (4.1 per game combined) and sets a platform of dominance in the middle. In 2018-19 he split time between midfield and defence, operating as a central defender in a back three at times, showcasing a versatility and positional awareness that adds to his allure. Aston Villa were one of several sides to bid for him last summer, per The Sun, with the sum around the 15 million mark. He\'s only improved, so if Leeds don\'t get promoted in 2020, even bigger fish will likely enter the ring for him. Brooks\' View The top sides aim to win the ball back fast, and Phillips would suit that style. He\'s an extremely intense presser of the ball and will lock on to opponents like a shadow, attempting to win it back as quickly as possible. The game is becoming quicker and more intense, with teams looking for athletic runners on and off the ball. Phillips suits this. His mobility and ability to cover ground quickly would see him thrive in the Premier League. His passing ability is mixed: He regularly floats longer passes to either flank but rarely distributes and passes through the centre of the pitch and could work on his willingness to break lines with passes. He also needs to prove he can take the more measured approach and be positionally disciplined to cover space. Good Fits: Arsenal, Wolves Said Benrahma, 24, Winger, Brentford Alex Burstow/Getty Images Another Championship player who is attracting interest from above is BenrahmaJones reports that Leicester City like the look of himand that checks out. He looks totally out of place in the second tier. Ten goals and 14 assists from 29 starts last season and 10 and 7 from 30, respectively, so far this term speaks to his attacking output. He\'s a goalscorer and a creator, regularly chipping in and helping the strikers decide games. Defenders have no idea how to handle him; he\'s too quick, too silky and boasts too much of a variety in his play to stop. He can dribble, he can pass, he can shoot and he can roam across the pitch to look for space. Allowed to blossom and shine at Brentford, given freedom to move and interpret, he\'s developed into some player. Brooks\' View Regularly deployed as a left winger who is also comfortable on the right, Benrahma is afforded the freedom to roam centrally and move between the lines. On the ball, his skill, ability to change tempo and stand players up attracts several opponents toward him, where he often wriggles away and looks to exploit the space vacated. Most sides in the Premier League are intense defensively, whether it\'s pressing high with aggression, or compactly in a mid block or low block, so Benrahma\'s press resistance is an important trait that should mean he makes the step up well. He has good vision and can split defences with forward passes, so would suit a side that has players willing to run ahead of the ball. However, he may need to work on his own runs ahead of the ball, rather than constantly looking to receive to feet. Good Fits: Leicester City, Everton, Aston Villa Kane Vincent-Young, 24, Right-Back, Ipswich Town James Baylis - AMA/Getty Images Probably the least recognisable name on this list is Vincent-Young\'s, who dropped down the Football League in order to rise back upRickie Lambert styleto the top. He has the profile of a modern full-back or wing-back, combining size and speed, along with sound technique, to dominate his flank. He mixes aggression and trickery when dribbling, throwing in feints and step-overs along with more powerful thrusts. He\'s shown an eye for goal (scoring a spectacular one vs. Tranmere Rovers) and a willingness to arrive at the back post for crosses. He stands up defensively, too, with his athleticism making him tough to beat. Brooks\' View Despite never playing higher than League One to date, it is just a matter of time before Vincent-Young reaches the top tier. My colleague Richard Webster has trained Vincent-Young on a one-to-one basis since he was 13, in the Spurs academy, and I have been part of his recent journey. He has the technique, athleticism and game-understanding needed to play in the Premier League and is able to provide attacking impetus in a variety of ways. Vincent-Young\'s technique and ball manipulation means he can carry the ball infield as well as outside through composed dribbling. His athleticism and balance also enables him to drive forward aggressively with pace. He can receive the ball deep to feet and drive up the pitch, or he can make forward runs ahead of the ball and receive high. He could still work on delivering crosses deep and early, though, as he usually prefers to stand his man up one-on-one. Good Fits: Tottenham Jude Bellingham, 16, Midfielder, Birmingham City Nathan Stirk/Getty Images For a 16-year-old to play a full campaign at senior level, rucking with fully grown adults every week, is quite something. Few can handle it physically, few can handle it mentally, yet Bellingham frequently looks a cut above on any pitch he walks out onand he\'s still on a youth contract worth 145 per week, per The Guardian. Jones has reported Manchester United are, understandably, hot on his heels. Borussia Dortmund have expressed major interest too. He\'s shown class on the ball, a high level understanding of movement, physicality and rare positional versatility, having already fulfilled multiple roles in the Blues\' midfield in 2019-20. He\'s a super young talent. Brooks\' View Bellingham has an incredible temperament and maturity on the football pitch, and those traits in particular are why he\'s become a first-team regular despite still only being 16. His game-understanding is outstanding. Whether he plays as a No. 6, No. 8 or a No. 10, he knows what to do in every situation. He has superb composure, his timing on the ball defies his tender years, and he can receive behind and ahead of the balla trait not many midfielders possess, let alone at 16. As Bellingham gets older, and no doubt joins one of the elite sides, he may have to find a home in a more specific role. \"Role-fillers\" are sought-after, and his ability to perform in a variety of them is a huge positive, but he will have to find a position to call home to establish himself at Premier League level, or in another major European division. Good Fits: Manchester United, Chelsea, Liverpool...everyone should be in for him Eberechi Eze, 21, Attacking Midfielder, Queens Park Rangers Andrew Redington/Getty Images This season, Eze has emerged as one of the stars of the Championship. He\'s one of best players in the division and perhaps the best to watch too. The way he glides across the pitch, carries the ball and ghosts past defenders draws you to the edge of your seat. With 20 goal contributions12 goals, eight assistsunder his belt this season, he\'s backing up some pretty play and clever off-the-ball movement with tangible production. Operating out of a relative free role, be it from behind the striker or cutting in off the left, his arced right-footed finishes are Ashley Young-esque, and his stuttered penalty-taking technique is prime Eden Hazard. Brooks\' View An extremely creative and dynamic dribbler, Eze is a rarity: He has superb skill but also an ability to aggressively carry and drive the ball up the pitch too. It\'s not always silky, but it\'s always effective and positive. He\'s comfortable receiving the ball in a variety of ways, in a variety of positions, while still managing to play forward as often as possible. He can lay it off first time, roll you, drop a shoulder or face you up and drive at you. His end product comes in a number of forms: he can score different types of goals but also create by threading passes into the final third. The ingenuity, unpredictability and dynamism he possesses makes him very difficult to stop. Like Benrahma, he thrives off the ability to express himself and be free. He may have to prove he can operate in a more structured setup in a higher league. Good fits: Tottenham, Wolves Listen to Sam every Wednesday on the B/R Football Ranks podcast. Subscribe here. Follow @stighefootball Instagram.com/brsamtighe All statistics via WhoScored.com. Facebook Logo Twitter Logo Copy Link Icon Related Report: PSG Make $65M Bid for Icardi Inter want $75M, with talks ongoing World Football Report: PSG Make $65M Bid for Icardi Sky Sportsvia Sky Sports Potential Premier League Bargains   B/R names 5 lower league talents  Expert recommends ideal clubs  Who is the next unearthed gem? World Football Potential Premier League Bargains  Sam Tighevia Bleacher Report Report: Pjanic Told PSG \'I Only Want Barca\' Juve midfielder turned down \'attractive\' PSG offer World Football Report: Pjanic Told PSG \'I Only Want Barca\' Edvia PSG Talk Is Ferguson Football\'s Closest Thing to Jordan? World Football Is Ferguson Football\'s Closest Thing to Jordan? via men Bleacher Report Logo Facebook Logo Twitter Logo Instagram Logo About Advertise Contact Us Careers Community Guidelines Privacy Cookie Preferences Terms Of Use Tickets AdChoices Copyright  2020 Bleacher Report, Inc. Turner Broadcasting System, Inc. All Rights Reserved. BleacherReport.com is part of Bleacher Report  Turner Sports Network, part of the Turner Sports and Entertainment Network. Certain photos copyright  2020 Getty Images. Any commercial use or distribution without the express written consent of Getty Images is strictly prohibited. AdChoices Turner Logo', 'World Football logo\n\nBIRMINGHAM, ENGLAND - JANUARY 25:  Jude Bellingham of Birmingham City during the FA Cup Fourth Round match between Coventry City and Birmingham City at St Andrew\'s Trillion Trophy Stadium on January 25, 2020 in Birmingham, England. (Photo by Marc Atkins/Getty Images)\n\nHULL, ENGLAND - FEBRUARY 29:  Kalvin Phillips of Leeds United looks on during the Sky Bet Championship match between Hull City and Leeds United at KCOM Stadium on February 29, 2020 in Hull, England. (Photo by James Gill - Danehouse/Getty Images)\n\nBRENTFORD, ENGLAND - JANUARY 28: Said Benrahma of Brentford looks on during the Sky Bet Championship match between Brentford FC and Nottingham Forest at Griffin Park on January 28, 2020 in Brentford, England. (Photo by Alex Burstow/Getty Images)\n\nIPSWICH, ENGLAND - AUGUST 31: Kane Vincent-Young of Ipswich Town and Ryan Giles of Shrewsbury Town during the Sky Bet League One match between Ipswich Town and Shrewsbury Town at Portman Road on August 31, 2019 in Ipswich, England. (Photo by James Baylis \n\nBIRMINGHAM, ENGLAND - AUGUST 31: Jude Bellingham of Birmingham City celebrates after he scores their second goal during the Sky Bet Championship match between Birmingham City and Stoke City at St Andrew\'s Trillion Trophy Stadium on August 31, 2019 in Birm\n\nLONDON, ENGLAND - FEBRUARY 15: Eberechi Eze of Queens Park Rangers celebrates after scoring his team\'s second goal during the Sky Bet Championship match between Queens Park Rangers and Stoke City at The Kiyan Prince Foundation Stadium on February 15, 2020\n\nWorld Football logo\n\nWorld Football logo\n\nWorld Football logo\n\nWorld Football logo\n\n', 'https://cdn.bleacherreport.net/images/team_logos/328x328/world_football.png\n\nhttps://static-assets.bleacherreport.net/img/atoms/deferredImage/placeholder.png\n\nhttps://static-assets.bleacherreport.net/img/atoms/deferredImage/placeholder.png\n\nhttps://static-assets.bleacherreport.net/img/atoms/deferredImage/placeholder.png\n\nhttps://static-assets.bleacherreport.net/img/atoms/deferredImage/placeholder.png\n\nhttps://static-assets.bleacherreport.net/img/atoms/deferredImage/placeholder.png\n\nhttps://static-assets.bleacherreport.net/img/atoms/deferredImage/placeholder.png\n\nhttps://cdn.bleacherreport.net/images/team_logos/328x328/world_football.png\n\nhttps://cdn.bleacherreport.net/images/team_logos/328x328/world_football.png\n\nhttps://cdn.bleacherreport.net/images/team_logos/328x328/world_football.png\n\nhttps://cdn.bleacherreport.net/images/team_logos/328x328/world_football.png\n\n', NULL, 1),
(17, 'http://www.football-italia.net/153500/juventus-all-clear-covid-19', 'Juventus all-clear of COVID-19 | Football Italia', 'TODAY\'S FRONT PAGES', '', '', '', '', '', 'Home | News | Blogs | Clubs | Serie A | Serie B | Coppa | Champ Lg | Europa | Azzurri | Euro 2016 | Live Scores | Watch Live | NEWS Thursday May 21 2020 Juventus all-clear of COVID-19 By Football Italia staff Juventus confirm all the COVID-19 tests came back negative, so its expected Gonzalo Higuain and Adrien Rabiot will return to training tomorrow. The club released a statement this afternoon, updating fans on the coronavirus situation within the squad. For several days now, the Juventus players have been carrying out individual training sessions in small groups, all whilst keeping their distance. In application of the indications by the FIGCs Federal Medical Scientific Commission, yesterday, the whole team underwent diagnostic tests which came back with negative results; in the next few days training will resume in larger groups. Blaise Matuidi  who had COVID-19 in March  and Sami Khedira also took part in training today. According to the Corriere dello Sport, it means Higuain and Rabiot will be allowed back into the training centre tomorrow. They returned later than the others from abroad, so needed to go into quarantine. However, the rules have been relaxed lately, giving them the all-clear if they have two negative swab tests in 48 hours. The same technique was applied by Milan for Zlatan Ibrahimovic when he returned from Sweden. Watch Serie A live in the UK on Premier Sports for just 11.99 per month including live LaLiga, Eredivisie, Scottish Cup Football and more. Visit: https://subscribe.premiersports.tv/ Print Send to a friend FOOTBALL ITALIA LATEST NEWS PSG \'offer 60m for Icardi\' Simoni: Ronaldo\'s greatest coach Agent: \'Gattuso wanted Politano at Milan\' Roma line up for Joao Pedro Simoni has died at the age of 81 FOOTBALL ITALIA RELATED NEWS Report: Arthur ready to listen to Juve Emre Can: \'Ronaldo is a leader\' Serie A: Match protocol by May 28 Vidal to Chiellini: \'There are codes\' Vidal: \'I want to continue at Barca\' TODAY\'S FRONT PAGES CLUB BY CLUB NEWS All material on this website is  Tiro Media Ltd 2020. All rights reserved. Republication or redistribution of content is expressly prohibited without the prior written consent. This site is not responsible for the content of external websites | Images courtesy of Action Images / Reuters | Contact us | RSS | Mobile | Developed by Psyberion. Privacy Policy | Cookie Policy | Website Terms Of Use', 'Home\n\nDelicious\n\nDigg\n\nStumbleUpon\n\nReddit\n\nFacebook\n\nTwitter\n\nGoogle\n\nYahoo\n\nBuzz Up!\n\nLinkedIn\n\nSoccer Italia Magazine Subscribe Now\n\nFootball Espana Coming Soon!\n\n', '/sites/all/themes/italia/logo2.png\n\n/sites/all/modules/service_links/images/delicious.png\n\n/sites/all/modules/service_links/images/digg.png\n\n/sites/all/modules/service_links/images/stumbleit.png\n\n/sites/all/modules/service_links/images/reddit.png\n\n/sites/all/modules/service_links/images/facebook.png\n\n/sites/all/modules/service_links/images/twitter.png\n\n/sites/all/modules/service_links/images/google.png\n\n/sites/all/modules/service_links/images/yahoo.png\n\n/sites/all/modules/service_links/images/buzz.png\n\n/sites/all/modules/service_links/images/linkedin.png\n\n/sites/all/themes/italia/images/soccer-italia-banner468x60.jpg\n\n/sites/all/themes/italia/images/Football-Espana-link-3.jpg\n\n', NULL, 1),
