 remaining matches of the season. The German Bundesliga may have returned to action behind closed doors this weekend but there is no indication yet as to when England\'s top division may do the same. Manchester City confirmed on Friday that their fans will receive an automatic refund for their outstanding six Premier League home matches, while Brighton and Norwich have also offered full reimbursement to fans. 1:32 The Sunday Supplement panel discuss Newcastle manager Steve Bruce\'s claim teams will not be ready for the Premier League\'s proposed return date of June 12 and that the season restart should come later than that. The Sunday Supplement panel discuss Newcastle manager Steve Bruce\'s claim teams will not be ready for the Premier League\'s proposed return date of June 12 and that the season restart should come later than that. Everton have now followed suit, with Toffees supporters also given the opportunity to gain credit towards their 2020/21 season tickets, or contribute to the club\'s charity, Everton in the Community. \"Everton has confirmed all fans with tickets for the club\'s remaining five home Premier League fixtures of the 2019/20 season will be able to claim a refund due to the increasing expectation that - should the remaining games be played -they will take place behind closed doors,\" the club said in a statement. 1:23 On-loan Everton defender Jonjoe Kenny is a huge admirer of the managerial skills of his Schalke boss David Wagner. On-loan Everton defender Jonjoe Kenny is a huge admirer of the managerial skills of his Schalke boss David Wagner. \"Season Ticket Members will be entitled to a credit or refund on a pro-rata basis for the five games and will also be given the option to forgo part or all of their balance in order for the club to donate that amount in full over to Everton in the Community. Also See: Players and managers \'feel lack of leadership\' Bruce, Sterling: PL cannot resume before end of June Digne: Everton can reach CL with Ancelotti PL \'Project Restart\' Q&A: Decision imminent \"The option for a portion - or all - of the available refund to be made available to Everton in the Community was introduced as a result of requests from fan groups and individual supporters who have been keen to show their appreciation for the club\'s charity. \"Season Ticket Members who may not have renewed for the 20/21 season when the remaining games for the 19/20 season are confirmed will be given the opportunity to request that their refund entitlement be used as a credit towards their renewal for next season.\" Super 6: Dortmund to keep heat on Bayern? Super 6 is back. Do not miss your chance to land the 50,000 jackpot. Play for free, entries by 2:30pm. Trending 1 Ancelotti: Zidane changed my ideas on football 2 Pippen \'beyond livid\' with Jordan over Last Dance 3 Barton feels sorry for Sunderland over play-offs 4 Who is the PL\'s greatest wonderkid? 5 PSG bid 44.7m for Inter striker Icardi 6 Neville: Premier League should save EFL clubs 7 Mourinho: I was unselfish when Inter won CL 8 Was Vettel \'burnt out\' at Ferrari? 9 Chisora: I\'ll help to plot Whyte\'s downfall 10 Arsenal\'s squad assessed: Stay or go? Video Latest News Home Sports Football F1 Cricket Rugby Union Rugby League Golf Boxing Olympics Tennis Racing Darts NFL NBA Netball GAA MMA More Sports Scores Video TV Sky Bet Games More Transfer Centre Live on Sky Get Sky Sports TV Shows TV Guide Competitions Sky Go Now TV Sports Scholarships Tackling Racism Podcasts Mobile Twitter Facebook Contact Us Terms & Conditions Twitter Facebook Sky Sports Get Sky Sports Sky Sports Apps Sportinglife.com TEAMtalk.com Football365.com Partners Sky Bet Fantasy Football Super 6 Living for Sport Planet Rugby Golf365 Planet F1 Cricket365 Sky Sports Channels Sky Sports Main Event Sky Sports Premier League Sky Sports Football Sky Sports Cricket Sky Sports Golf Sky Sports Racing Sky Sports F1 Sky Sports Action Sky Sports Arena Sky Sports News Sky Sports Mix More Sky 