 Stevenage Swindon Town Walsall Aberdeen Celtic Hamilton Academical Heart of Midlothian Hibernian Kilmarnock Livingston Motherwell Rangers Ross County St Johnstone St Mirren Athletic Bilbao Atletico Madrid Barcelona CD Leganes Celta Vigo Deportivo Alaves Eibar Espanyol Getafe Granada Levante Osasuna Real Betis Real Madrid Real Mallorca Real Sociedad Real Valladolid Sevilla Valencia Villarreal AC Milan Atalanta Bologna Brescia Cagliari Fiorentina Genoa Hellas Verona Inter Milan Juventus Lazio Lecce Napoli Parma Roma Sampdoria Sassuolo Spal Torino Udinese Bayer Leverkusen Bayern Munich Borussia Dortmund Borussia Monchengladbach Cologne Eintracht Frankfurt FC Augsburg FC Schalke 04 Fortuna Dusseldorf FSV Mainz 05 Hertha Berlin RB Leipzig SC Freiburg SC Paderborn 07 TSG Hoffenheim Union Berlin Werder Bremen Wolfsburg Amiens SC Angers Brest Dijon FC Metz Girondins Bordeaux Lille Monaco Montpellier Nantes Nice Nimes Olympique Lyonnais Olympique Marseille Paris Saint-Germain RC Strasbourg Reims St Etienne Stade Rennes Toulouse ADO Den Haag Ajax AZ Alkmaar FC Emmen FC Groningen FC Twente FC Utrecht Feyenoord Fortuna Sittard Heerenveen Heracles Almelo PEC Zwolle PSV Eindhoven RKC Waalwijk Sparta Rotterdam Vitesse Arnhem VVV Venlo Willem II Tilb Albania Algeria Argentina Australia Austria Belgium Bolivia Bosnia-Herzegovina Brazil Cameroon Chile Colombia Costa Rica Croatia Czech Republic Denmark Ecuador Egypt England Estonia France Germany Ghana Greece Honduras Hungary Iceland Iran Italy Ivory Coast Jamaica Japan Korea DPR Korea Republic Mexico Montenegro Morocco Netherlands New Zealand Nigeria Northern Ireland Panama Paraguay Peru Poland Portugal Republic of Ireland Romania Russia Saudi Arabia Scotland Senegal Serbia Slovakia Slovenia South Africa Spain Sweden Switzerland Tunisia Turkey Ukraine Uruguay USA Venezuela Wales England Germany Holland Israel Italy Norway Russia Spain Angola Burkina Faso Cape Verde Congo DR Ethiopia Mali Niger Nigeria Togo Zambia Teams Tables Leagues/Cups Fixtures Results Transfers Video On Sky Sky Bet Coronavirus: EFL League One, League Two clubs could fold without Government bailout - MP Damian Collins MP: \"In the next few weeks we could see five to 10 EFL League clubs going into administration... without Government stepping in, those clubs could go to the wall.\" By Geraint Hughes, Sky Sports News reporter Last Updated: 22/05/20 2:40pm Some EFL clubs are facing an uphill financial battle amid the COVID-19 pandemic An urgent and substantial Government bailout is needed for clubs in the EFL Leagues One and Two, otherwise, up to 10 clubs could go into administration within weeks. That is the view of former Chair of the Commons Select Committee, Damian Collins MP, and the co-owner of League One Sunderland, Charlie Methven. In an interview with Sky Sports News, Collins said the parlous financial state of many League One and Two clubs even before the coronavirus crisis was worrying, but the impact of the pandemic was making the plight of clubs more acute. Collins has called on the Government to provide a financial bailout package, otherwise by next month many clubs will have to file for administration and, if no support is forthcoming, they could cease to exist. Super 6: Dortmund to keep heat on Bayern? Super 6 is back. Do not miss your chance to land the 50,000 jackpot. Play for free, entries by 2:30pm. EFL talks: L1 play-off plan, Stevenage face relegation Sunderland: End L1 on pitch, not in court Decisions on Championship, League One fates delayed He said: \"In the next few weeks we could see five to 10 EFL League clubs going into administration. \"We saw the outcry last summer when two clubs, Bury and Bolton were in trouble. If that happens there will be huge public demand to do something, without Government stepping in, those clubs could go to the wall and there may be others that follow. \"Yes it be would be nice if football could help itself, but it won\'t be able to do it. \"I don\'t think there is a body able to stump up the cash needed it requires leadership from the government here. They need to offer a stake in the clubs, as it\'s a community asset. Those stakes could be bought by Trusts and local authorities.\" EFL chairman Rick Parry has previously indicated that clubs face a \"200m financial hole\" by September Collins and Methven have drafted a six-point plan to \"rescue football and protect community assets for future generations to enjoy\". In their open letter, the six-point plan advocates... A \'Football Finance Authority\' (FFA) scheme should be created by the Football Association - but working with and backed financially by the government - to provide financial assistance to EFL clubs. Funds should be provided by the FFA to allow clubs to meet their short-term liabilities and provide them enough breathing space to restructure their finances, but couldn\'t be used to invest in recruiting new players or improving the club\'s infrastructure. Rather than being offered as loans, these funds would instead be exchanged for a minority shareholding in the club, of between 10 per cent to 49 per cent, depending on the level of investment required and the value of the club. Independent directors would be appointed to the boards of clubs as representatives for this minority shareholding. These directors can be nominated by either a registered Supporters Trust or by the relevant local government authority, but they must be non-political and subject to approval as \'Fit and Proper\' by the FFA. These Independent Directors shall have real-time access to the financial records of their club and can report their concerns back to the FFA. Clubs that continue to trade outside the rules of the EFL would be put into a form of administration by the FFA, where a credible plan would be implemented by independent auditors to bring the financial affairs of the club back in line with the League\'s rules. Either a recognised Supporters Trust or a local authority can subsequently acquire the FFA shareholding in their club at a discount to market value, and funds raised in this way would be returned to the government to help repay the public investment in this scheme. The EFL\'s financial regulations should be set and enforced by the FFA, the governing body of which should include representation from the EFL, the Professional Footballers Association (PFA), the Football Supporters Association (FSA) and the clubs themselves, but with an independent majority. 3:42 Sky Sports News reporter Ben Ransom says the English Football League has provided its clubs with a \'clear pathway\' to curtail the 2019-20 season Sky Sports News reporter Ben Ransom says the English Football League has provided its clubs with a \'clear pathway\' to curtail the 2019-20 season Collins warned that a Government bailout, in effect taxpayers\' money, must come with a six-point \'strings attached\' plan, otherwise, within months the clubs would continue to be run so badly they will be coming back needing more. Money must not be used to buy players, it\'s sole function must be used for financial sustainability. EFL Chair Rick Parry told a Commons Select Committee earlier this month that the EFL would face a \'black hole of 200m\' by September and the former Chair of that Committee said that figure was \"not fantastical\" although he doubted whether any Government would provide a bailout amounting to that figure. It is understood that the EFL and its clubs have been discussing for some time about ways to reform financial rules and that those positive discussions remain ongoing. Government wants grassroots football back \'as soon as safely can\' Coronavirus in Sport latest Championship players given self-test option Following the release of this open letter, a Government DCMS spokesperson told Sky Sports News: \"We are in regular, ongoing discussions with the EFL and other football authorities on the impact of coronavirus, how the professional game can safely return and how the wider football family can be supported.\" Earlier this month Secretary of State for Culture, Media & Sport Oliver Dowden announced a 16m package to help Rugby League through its financial problems. 0:44 PFA chief executive Gordon Taylor says the steps being taken towards the resumption of football are \'encouraging\', but warns they must be cautious in their approach PFA chief executive Gordon Taylor says the steps being taken towards the resumption of football are \'encouraging\', but warns they must be cautious in their approach Their six-point plan has received backing from the former Football Association Chair Baron David Triesman. He said: \"Damian Collins and Charlie Methven have clearly devoted considerable thought to the financial and social crises facing football. \"They have identified some very practical routes through to a more secure future and I welcome this wholeheartedly. It is a pity that football so seldom does the work needed itself. \"But it doesn\'t. This is therefore an especially important intervention.\" Malcolm Clarke, chair of the Football Supporters\' Association and supporter representative on the FA Council also added his support: \"The necessary restrictions arising from the COVID-19 pandemic have made government support for football clubs - a vital part of our communities and culture - an urgent necessity. \"We welcome the call for that assistance to be both prompt and linked to future sustainability. \"Football now has a unique opportunity to reset and adopt new ideas, which not only secure the short-term future of clubs, but help them thrive in the seasons ahead. Also See: EFL talks: L1 play-off plan, Stevenage face relegation L2 clubs vote to end season early Could pandemic see B teams join EFL? Palios: Deciding L1 on points-per-game unfair \"These proposals would be a huge step in the right direction and chime with the FSA\'s core beliefs - that fans have a key role to play in football governance and ownership models. \"The idea of an independent unit, embedded within the FA, which exists to protect clubs is an idea we\'ve championed for some time. It receives our full support.\" Super 6: Dortmund to keep heat on Bayern? Super 6 is back. Do not miss your chance to land the 50,000 jackpot. Play for free, entries by 2:30pm. Trending 1 Ancelotti: Zidane changed my ideas on football 2 Pippen \'beyond livid\' with Jordan over Last Dance 3 Barton feels sorry for Sunderland over play-offs 4 Who is the PL\'s greatest wonderkid? 5 PSG bid 44.7m for Inter striker Icardi 6 Neville: Premier League should save EFL clubs 7 Mourinho: I was unselfish when Inter won CL 8 Was Vettel \'burnt out\' at Ferrari? 9 Chisora: I\'ll help to plot Whyte\'s downfall 10 Arsenal\'s squad assessed: Stay or go? Video Latest News Home Sports Football F1 Cricket Rugby Union Rugby League Golf Boxing Olympics Tennis Racing Darts NFL NBA Netball GAA MMA More Sports Scores Video TV Sky Bet Games More Transfer Centre Live on Sky Get Sky Sports TV Shows TV Guide Competitions Sky Go Now TV Sports Scholarships Tackling Racism Podcasts Mobile Twitter Facebook Contact Us Terms & Conditions Twitter Facebook Sky Sports Get Sky Sports Sky Sports Apps Sportinglife.com TEAMtalk.com Football365.com Partners Sky Bet Fantasy Football Super 6 Living for Sport Planet Rugby Golf365 Planet F1 Cricket365 Sky Sports Channels Sky Sports Main Event Sky Sports Premier League Sky Sports Football Sky Sports Cricket Sky Sports Golf Sky Sports Racing Sky Sports F1 Sky Sports Action Sky Sports Arena Sky Sports News Sky Sports Mix More Sky Sites Sky.com Sky News Sky Corporate Sky For Businesses Now TV Sky Communal TV Sky Academy Bigger Picture Store Locator Work for Sky Advertise With Us Sky TV Accessories Terms & Conditions Privacy & Cookies Notice Privacy Options Accessibility Information Contact Us 2020 Sky UK We would like your feedback, please fill in our survey', 'Some EFL clubs are facing an uphill financial battle amid the COVID-19 pandemic\n\nEFL cha