(32, 'https://www.skysports.com/transfer-centre', 'Transfer Centre - Football Transfers News & Rumours | Sky Sports', 'Transfer Centre: Gareth Bale, Sergio Aguero, Pierre-Emerick Aubameyang LIVE!', 'Transfer Centre The latest transfer news and rumours, with updates on Gareth Bale, Sergio Aguero, Pierre-Emerick Aubameyang and more! Transfer Centre', 'Live Blog Transfer Centre News features', 'Sky Bet Hot Topic Chelsea exercise one-year option on Caballero Transfer Centre: Bale, Aguero, Aubameyang LIVE! PSG bid 44.7m for Inter striker Icardi Football transfer rumours Arsenal\'s squad assessed: Stay or go? At home with... Stoke: Bouncebackability & O\'Neill Potter on his and Brighton\'s evolution', 'Transfer headlines', '', 'Search Transfer Centre Live Blog Live Blog News Features Done Deals Teams Paper Talk Rumours Betting Get Sky Sports Transfer Centre: Gareth Bale, Sergio Aguero, Pierre-Emerick Aubameyang LIVE! The latest transfer news and rumours, with updates on Gareth Bale, Sergio Aguero, Pierre-Emerick Aubameyang and more! Powered by Livefyre Sky Bet Transfer Specials Where will Jadon Sancho go? Neymar to return? Jack Grealish to depart? Play Super 6 All Transfer Specials Sky Bet EFL Odds Transfer Centre Watch all the latest transfer news from Sky Sports News Hot Topic Transfer headlines Chelsea exercise one-year option on Caballero Chelsea have exercised an option to extend goalkeeper Willy Caballero\'s contract by a further year. Transfer Centre News Transfer Centre: Bale, Aguero, Aubameyang LIVE! The latest transfer news and rumours, with updates on Gareth Bale, Sergio Aguero, Pierre-Emerick Aubameyang and more! 30/01/20 7:00am PSG bid 44.7m for Inter striker Icardi Paris Saint-Germain have made an opening offer of 44.7m (50m) plus a further 8.9m (10m) in add-ons for Mauro Icardi from Inter Milan. 22/05/20 12:05pm Football transfer rumours Looking for transfer rumours and gossip? Get the latest all in one place... 22/05/20 9:15am View more transfer news features Arsenal\'s squad assessed: Stay or go? What are the big decisions facing Mikel Arteta as he looks to reshape his Arsenal squad... 21/05/20 7:00am At home with... Stoke: Bouncebackability & O\'Neill Stoke duo Danny Batth and Sam Vokes discuss a difficult start to the season, working with Michael O\'Neill and much, much more. 21/05/20 10:30am Potter on his and Brighton\'s evolution Graham Potter has transformed Brighton\'s style of play. But his first season in the Premier League has been a tough next step in his development as a coach too... 21/05/20 12:01pm View more Features Home Sports Football F1 Cricket Rugby Union Rugby League Golf Boxing Olympics Tennis Racing Darts NFL NBA Netball GAA MMA More Sports Scores Video TV Sky Bet Games More Transfer Centre Live on Sky Get Sky Sports TV Shows TV Guide Competitions Sky Go Now TV Sports Scholarships Tackling Racism Podcasts Mobile Twitter Facebook Contact Us Terms & Conditions Twitter Facebook Sky Sports Get Sky Sports Sky Sports Apps Sportinglife.com TEAMtalk.com Football365.com Partners Sky Bet Fantasy Football Super 6 Living for Sport Planet Rugby Golf365 Planet F1 Cricket365 Sky Sports Channels Sky Sports Main Event Sky Sports Premier League Sky Sports Football Sky Sports Cricket Sky Sports Golf Sky Sports Racing Sky Sports F1 Sky Sports Action Sky Sports Arena Sky Sports News Sky Sports Mix More Sky Sites Sky.com Sky News Sky Corporate Sky For Businesses Now TV Sky Communal TV Sky Academy Bigger Picture Store Locator Work for Sky Advertise With Us Sky TV Accessories Terms & Conditions Privacy & Cookies Notice Privacy Options Accessibility Information Contact Us 2020 Sky UK We would like your feedback, please fill in our survey', '', '', NULL, 1),
(33, 'https://www.skysports.com/football/transfer-paper-talk', 'Paper Talk - Regional, National & International Football News', 'Paper Talk', 'Transfer Centre', 'Paper Talk Super 6: Dortmund to keep heat on Bayern? Transfer Centre News features', 'Sky Bet Hot Topic Chelsea exercise one-year option on Caballero More Transfer Rumours Transfer Centre: Bale, Aguero, Aubameyang LIVE! PSG bid 44.7m for Inter striker Icardi Football transfer rumours Arsenal\'s squad assessed: Stay or go? At home with... Stoke: Bouncebackability & O\'Neill Potter on his and Brighton\'s evolution', 'Transfer headlines', '', 'Search Transfer Centre Paper Talk Live Blog News Features Done Deals Teams Paper Talk Rumours Betting Get Sky Sports Paper Talk Newcastle\'s takeover has been given the green light as Premier League bosses have finally approved the 300m Saudi deal. Romelu Lukaku says he will \"never forgive\" Andre Villas-Boas for leaving him out of Chelsea\'s Champions League-winning squad in 2012. Gareth Bale was reportedly rejected by an MLS club due to eye-watering wage demands. Barcelona are reportedly prepared to allow seven players to leave on swap deals to ensure Lautaro Martinez signs from Inter Milan this summer. Serge Aurier\'s latest lockdown lapse could cost him 140,000. N\'Golo Kante was back at Chelsea on Thursday for a second day of testing - a day after being given compassionate leave due to his fears over coronavirus. QPR captain Grant Hall has joined a growing camp of players who think it is too dangerous for football to return. Premier League footballers have been warned against signing documents that could affect their rights if they contract coronavirus. EFL clubs fear curtailing the seasons in League One and League Two could lead to a Championship breakaway. Danny Drinkwater is continuing to train with Aston Villa following his bust-up with team-mate Jota days before the Premier League was suspended. Premier League clubs are facing another major financial blow amid fears the shirt sponsorship bubble has burst. The FA Cup faces being abandoned for the first time in peacetime since it began 149 years ago, although the Premier League is pulling out all the stops to rescue it. Premiership Rugby\'s hopes of completing their full league programme have been said to be \"a long shot\" with clubs now not expected to return to training until next month at the earliest. The British Masters will restart the European Tour on July 23 before a five-week \"festival of golf.\" PSG are considering a 35m bid for Arsenal\'s Pierre-Emerick Aubameyang as his contract winds down. Gareth Bale can prove he is still one of the world\'s best players by moving to Newcastle United - says Brazilian legend Ronaldo. Arsenal have reportedly entered negotiations over a move to sign Adrien Rabiot, as Juventus bid to raise funds for a possible swoop for Manchester United\'s Paul Pogba. Manchester United are keeping tabs on Sporting Lisbon star Nuno Mendes, who has been dubbed the \"best under-19s left-back in Europe.\" The FA are determined to conclude this season\'s FA Cup alongside the Premier League should it resume safely, with behind-closed-doors semis and a final at Wembley. Championship clubs are facing growing opposition from concerned players to their plans to restart the season. Manchester City star Sergio Aguero is being eyed by Inter Milan as a replacement for Lautaro Martinez as the forward is edging closer to Barcelona. Andre Villas-Boas has reportedly snubbed an offer from Newcastle to take over the club once the 300m Saudi-backed takeover goes through. Arsenal target Odsonne Edouard has the backing of the Gunners\' record goalscorer, Thierry Henry, to go \"right to the top\". PSG have withdrawn from the race to sign Napoli central defender Kalidou Koulibaly. Chelsea are preparing for Valencia to make a bid to sign Kepa Arrizabalaga this summer, according to reports in Spain. Liverpool boss Jurgen Klopp has added Sevilla star Diego Carlos to his summer transfer shortlist and the 27-year-old centre-back has a 67m release clause in his contract. Arsenal are reportedly weighing up a summer move for Besiktas centre-back Domagoj Vida, who could be available for as little as 6million in the upcoming transfer window. Barry Ferguson has urged Rangers to splash the cash to sign his nephew Lewis Ferguson. Ianis Hagi\'s move to Rangers on a permanent deal is in the final stages, according to reports. Dundee United have been tracking Finnish Under-21 star Ilmari Niskanen. Super 6: Dortmund to keep heat on Bayern? Super 6 is back. Do not miss your chance to land the 50,000 jackpot. Play for free, entries by 2:30pm. What the bookies say Sky Bet Next Premier League manager to leave betting Sky Bet Transfer Specials Where will Jadon Sancho go? Neymar to return? Jack Grealish to depart? Play Super 6 All Transfer Specials Sky Bet EFL Odds Hot Topic Transfer headlines Chelsea exercise one-year option on Caballero Chelsea have exercised an option to extend goalkeeper Willy Caballero\'s contract by a further year. More Transfer Rumours Daily Mirror The Sun Daily Star Daily Mail Daily Express The Independent Daily Telegraph Guardian The Times Transfer Centre News Transfer Centre: Bale, Aguero, Aubameyang LIVE! The latest transfer news and rumours, with updates on Gareth Bale, Sergio Aguero, Pierre-Emerick Aubameyang and more! 30/01/20 7:00am PSG bid 44.7m for Inter striker Icardi Paris Saint-Germain have made an opening offer of 44.7m (50m) plus a further 8.9m (10m) in add-ons for Mauro Icardi from Inter Milan. 22/05/20 12:05pm Football transfer rumours Looking for transfer rumours and gossip? Get the latest all in one place... 22/05/20 9:15am View more transfer news features Arsenal\'s squad assessed: Stay or go? What are the big decisions facing Mikel Arteta as he looks to reshape his Arsenal squad... 21/05/20 7:00am At home with... Stoke: Bouncebackability & O\'Neill Stoke duo Danny Batth and Sam Vokes discuss a difficult start to the season, working with Michael O\'Neill and much, much more. 21/05/20 10:30am Potter on his and Brighton\'s evolution Graham Potter has transformed Brighton\'s style of play. But his first season in the Premier League has been a tough next step in his development as a coach too... 21/05/20 12:01pm View more Features Home Sports Football F1 Cricket Rugby Union Rugby League Golf Boxing Olympics Tennis Racing Darts NFL NBA Netball GAA MMA More Sports Scores Video TV Sky Bet Games More Transfer Centre Live on Sky Get Sky Sports TV Shows TV Guide Competitions Sky Go Now TV Sports Scholarships Tackling Racism Podcasts Mobile Twitter Facebook Contact Us Terms & Conditions Twitter Facebook Sky Sports Get Sky Sports Sky Sports Apps Sportinglife.com TEAMtalk.com Football365.com Partners Sky Bet Fantasy Football Super 6 Living for Sport Planet Rugby Golf365 Planet F1 Cricket365 Sky Sports Channels Sky Sports Main Event Sky Sports Premier League Sky Sports Football Sky Sports Cricket Sky Sports Golf Sky Sports Racing Sky Sports F1 Sky Sports Action Sky Sports Arena Sky Sports News Sky Sports Mix More Sky Sites Sky.com Sky News Sky Corporate Sky For Businesses Now TV Sky Communal TV Sky Academy Bigger Picture Store Locator Work for Sky Advertise With Us Sky TV Accessories Terms & Conditions Privacy & Cookies Notice Privacy Options Accessibility Information Contact Us 2020 Sky UK We would like your feedback, please fill in our survey', 'the sun\n\ndaily mail\n\ndaily telegraph\n\ndaily mirror\n\ndaily star\n\ndaily express\n\nscottish sun\n\n', '/transfercentre/img/papertalk/THE SUN.png\n\n/transfercentre/img/papertalk/DAILY MAIL.png\n\n/transfercentre/img/papertalk/DAILY TELEGRAPH.png\n\n/transfercentre/img/papertalk/DAILY MIRROR.png\n\n/transfercentre/img/papertalk/DAILY STAR.png\n\n/transfercentre/img/papertalk/DAILY EXPRESS.png\n\n/transfercentre/img/papertalk/SCOTTISH SUN.png\n\n', NULL, 1),
