(35, 'https://itunes.apple.com/app/goal.com/id518026818', 'Goal.com on the App Store', 'Goal.com 4+', 'Goal.com Screenshots Description Whats New Ratings and Reviews Information Supports More By This Developer You May Also Like', 'Wrong formation every time... App went downhill App in general Family Sharing', 'With Family Sharing set up, up to six family members can use this app.', '', '', 'Global Nav Open Menu Global Nav Close Menu Apple Shopping Bag + Search apple.com Cancel Apple Mac iPad iPhone Watch TV Music Support Shopping Bag + Cancel App Store Preview This app is available only on the App Store for iPhone and iPad. Goal.com 4+ Goal.com 4.2, 1.4K Ratings Free Screenshots iPhone iPad Description Breaking news AND the fastest live football scores straight to your mobile  Goal News now has the best of both worlds. Transfer rumours, in-depth articles, live scores, goal alerts, match stats Weve got it all. Features include: AROUND THE CLOCK NEWS Dive into Goals massive collection of detailed articles and breaking news stories. TRANSFER UPDATES Be the first to know the latest transfer news, from the planets best sources. WORLDWIDE COVERAGE English Premier League, La Liga, Bundesliga, Serie A, Ligue 1, Champions League We cover the globe. INSTANT NOTIFICATIONS Breaking news AND live goal alerts  you will not find a faster football app! COMPREHENSIVE MATCH DATA Extensive statistics powered by Opta, including; Line-ups, live text commentary, tables, fixtures and more. HEAD-TO-HEAD STATS A Head-to-Head section to see how upcoming opponents have performed against each other. Whats New Version History Mar 26, 2020 Version 10.0.5 We have listened to your feedback and made important updates to loading speed and app freezing, to make your in-app experience even better. Ratings and Reviews See All 4.2 out of 5 1.4K Ratings 1.4K Ratings Fats for free 3247 , 01/01/2020 Wrong formation every time... This app gets the formation wrong every time. Im a wolves supporter and today is wolves vs watford. The app said wolves were playing a 343 formation when it was actually 3421. Another time with El-Classico, the app said Real Madrid were playing a 433 and it said Isco was in LW. Even when the match started they didnt bother to change it. It makes you look like an idiot in front of your friends. I showed my friends the el Classico formations on goal and they thought I was joking. Its called Goal for a reason, its best known for getting goals early. LongTimeUserDylan , 05/02/2018 App went downhill Goal used to be a great app. I have used goal for news and scores for probably 8 years at least and its gotten to the point where I hate to use it anymore. For starters, the ADs are incredibly intrusive. Its one thing for ADs to just be everywhere but goal forces them upon you and anytime you open the app or a story ADs constantly pop up in your face and you cant even use the app until time has expired. I cant even remember one AD because I get so mad when it pops up I refuse to look at it. Additionally media does not work on the iphone app. I have never been able to open a story with a video and watch it on the iphone app. Multimedia on iphone apps is pretty norm so it shouldnt be hard to deliver videos to a mobile iphone app. Eliozo , 09/22/2019 App in general In my opinion, this is the best application to use for football news and live scores. If you know how to use it, this app can be wonderful. Just turn on notifications and set some teams/leagues you like in your favorites. You sometimes get live scores notifications before happening on tv, you can tell its a goal and flex on your friends without them knowing. Talking about football news, they send notifications of the latest rumors and news about your favorite clubs. Information Seller Goal.com Size 94.8 MB Category Sports Compatibility Requires iOS 11.0 or later. Compatible with iPhone, iPad, and iPod touch. Languages English, Arabic, Bosnian, Croatian, Dutch, French, German, Hungarian, Indonesian, Italian, Japanese, Korean, Portuguese, Simplified Chinese, Spanish, Thai, Traditional Chinese, Turkish, Vietnamese Age Rating 4+ Copyright  2015 Goal.com Price Free Developer Website App Support Privacy Policy Developer Website App Support Privacy Policy Supports Family Sharing With Family Sharing set up, up to six family members can use this app. More By This Developer See All Goal Live Scores Sports Resultados Ole Sports You May Also Like See All FC Barcelona Official App Sports SuperSport Sports LiveScore: Live Sport Updates Sports BBC Sport Sports Manchester United Official App Sports Premier League - Official App Sports More ways to shop: Find an Apple Store or other retailer near you. Or call 1-800-MY-APPLE. Choose your country or region Copyright  2020 Apple Inc. All rights reserved. Privacy Policy Terms of Use Sales and Refunds Legal Site Map', '', '', NULL, 1),
