(39, 'http://www.dailymail.co.uk/sport/sportsnews/article-8343751/Man-United-debt-soar-42-cent-430m-feel-effects-Covid-19.html', 'Manchester United reveal debt has soared by 127.4m to 429m as clubs finances hammered by covid-19 | Daily Mail Online', 'Manchester United reveal debt has soared by 127.4m to 429m as clubs finances hammered by covid-19', 'Manchester United reveal debt has SOARED by 127.4m to 429m, with revenues slumping and TV companies in line for a 15m rebate because of the coronavirus shutdown RELATED ARTICLES Share this article RELATED ARTICLES Share this article More top stories Get the Sports News RSS feed', 'Share or comment on this article: Comments 623 Add your comment Stars of sport TOP SPORT STORIES more stars of sport Season at a glance', '', '', '', 'Home News U.S. Sport TV&Showbiz Australia Femail Health Science Money Video Travel DailyMailTV Discounts Argos AO.com John Lewis Groupon Debenhams Wayfair Very eBay Boohoo Nike Currys Virgin Media NOW TV My Profile Logout Login Football Premier League Bundesliga Transfer News Boxing Rugby Golf Cricket F1 Tennis MMA Racing More My Profile Logout Login Friday, May 22nd 2020 5PM 33C 8PM 24C 5-Day Forecast Advertisement show ad Manchester United reveal debt has SOARED by 127.4m to 429m, with revenues slumping and TV companies in line for a 15m rebate because of the coronavirus shutdown Old Trafford club\'s latest figures show a stunning 42 per cent rise in debt United\'s debt has increased 127.4m to 429.1m over course of the past year Revenues have dropped 19 per cent year-on-year up until March 31 to 123.7m United will also have to pay 15m back to Premier League broadcasters Financial figures show only initial impact of the shutdown caused by Covid-19 United say they will revise predicted revenues of up to 580m amid the crisis Heres how to help people impacted by Covid-19 By Chris Wheeler for MailOnline Published: 12:13 BST, 21 May 2020 | Updated: 16:59 BST, 21 May 2020 e-mail 2k shares 623 View comments Manchester United\'s latest financial figures have revealed just how much the club are beginning to feel the effects of the coronavirus pandemic. Broadcasting, matchday and retail, revenue are down by more than 30million in the first three months of 2020, according to the results released on Thursday which show that United\'s net debt has shot up by 127.4m to 429.1m. United have withdrawn their previous revenue forecast of between 560-580m for the year \'given ongoing uncertainty due to COVID-19 and the evolving related economic and financial consequences\'. Manchester United have seen debt soar by 42 per cent to almost 430m in recent months Executive vice-chairman Ed Woodward is bracing for a heavy impact from the Covid-19 crisis RELATED ARTICLES Previous 1 Next \'He was brutal with me\': Gary Neville reveals how Peter... \'I\'d rather have a hole in the squad than an a***hole\': Ole... \'It\'s only the first day, but it\'s been a good start\':... Jadon Sancho \'still likely to leave Borussia Dortmund this... Share this article Share 2k shares United\'s executive vice-chairman Ed Woodward warned that the results for the next two quarters could be even worse. \'Our third quarter results published today reflect a partial impact that the pandemic has had on the club, while the greater impact will be in the current quarter and likely beyond,\' said Woodward. Broadcasting revenue was down more than 50 per cent on the previous quarter, a decrease of 27.7m. This is largely based on United\'s estimate that they will have to pay back 20m to Sky Sports, BT Sports and international broadcasters because their remaining games will be played behind closed doors  with 15m of that total accounted for in this quarter. Matchday revenue was down by 2.6m due to United\'s remaining home games in the Premier League and Europa League being postponed. Retail revenue also dropped by 1.1m due to the closure of the club\'s megastore, although there was still a small increase in both commercial (2m) and sponsorship revenue (3.1m). United\'s gross debt has not changed but the net debt (calculated as gross debt minus cash reserves) has risen significantly. This is because the club\'s cash balance has dropped to 90.3m, in part due to paying Leicester City 80m up front for Harry Maguire and the first instalment on Bruno Fernandes\'s 46.6m initial fee from Sporting Lisbon. However, United remain in better financial health than their rivals and still have access to a further 150m credit facility. Finances will take another hit with any more games this season played behind closed doors United owners Avram Glazer (left) and Joel Glazer will take a heavy hit amid the Covid-19 crisis Despite the worrying financial outlook, Woodward insisted that it takes second place to the more wide-ranging impact of the pandemic. \'Our focus remains on the health and well-being of our colleagues, fans and partners around the world and we are extremely proud of how those connected to the club have responded during this crisis,\' he added. \'Since the start of the pandemic, Manchester United and our Foundation have provided assistance to hospitals, charities and schools in our communities, as well as support for frontline workers and vulnerable fans. \'These actions reflect our core values as a club and the resilience through adversity that we have demonstrated many times throughout our long history and will do so again to weather these current challenges. \'In that spirit, we look forward to the team safely returning to the pitch and building on the exciting momentum that Ole and the players had previously achieved, while taking all necessary steps to protect public health. Our thoughts remain with all those affected during this unprecedented time.\' United\'s financial statement on Thursday further explained how the club have reacted to the worldwide crisis. Ole Gunnar Solskjaer\'s team had played themselves into good form when the season stopped It read: \'Manchester United has taken a range of measures to support its communities in response to the COVID-19 pandemic, including donations to food banks and outreach to elderly and disabled supporters. \'In addition, the Manchester United Foundation has committed over 1M to community initiatives, including the supply of 60,000 meals for health workers in local hospitals and support for schools and vulnerable children across Greater Manchester. \'The Club has also used its media platforms to deliver public health messages and to support frontline workers around the world. \'Operationally, the impact of the pandemic and measures to prevent further spread continues to disrupt its businesses in a number of ways, most significantly in Broadcasting and Matchday operations. \'Old Trafford and its flagship Megastore operations have been closed to visitors since 20 March 2020 and Museum, Stadium Tour and Red Caf operations have been closed since 17 March 2020. \'Government imposed restrictions have also resulted in the postponement of the Premier League, UEFA competitions and FA Cup competition since 13 March 2020. \'Postponement of the Premier League and changes to match scheduling has resulted in a reduction in the total broadcasting revenue expected for the season and has impacted broadcasting revenue during the quarter for matches played to date. \'In addition, during the quarter, Broadcasting and Matchday revenues were impacted due to the postponement of three matches: one away Premier League match, one home Round of 16 Europa League match and one away FA Cup quarter-final match.\' RELATED ARTICLES Previous 1 Next \'He was brutal with me\': Gary Neville reveals how Peter... \'I\'d rather have a hole in the squad than an a***hole\': Ole... \'It\'s only the first day, but it\'s been a good start\':... Jadon Sancho \'still likely to leave Borussia Dortmund this... Share this article Share 2k shares Share or comment on this article: Manchester United reveal debt has soared by 127.4m to 429m as clubs finances hammered by covid-19 e-mail 2k shares Add comment Comments 623 Share what you think Newest Oldest Best rated Worst rated View all The comments below have not been moderated. View all The views expressed in the contents above are those of our users and do not necessarily reflect the views of MailOnline. Add your comment Enter your comment Post comment to your Facebook Timeline What\'s This? By posting your comment you agree to our house rules. Submit Comment Clear Close Do you want to automatically post your MailOnline comments to your Facebook Timeline? Your comment will be posted to MailOnline as usual. No Yes Close Do you want to automatically post your MailOnline comments to your Facebook Timeline? Your comment will be posted to MailOnline as usual We will automatically post your comment and a link to the news story to your Facebook timeline at the same time it is posted on MailOnline. To do this we will link your MailOnline account with your Facebook account. Well ask you to confirm this for your first post to Facebook. You can choose on each post whether you would like it to be posted to Facebook. Your details from Facebook will be used to provide you with tailored content, marketing and ads in line with our Privacy Policy. More top stories Bing Site Web Enter search term: Search Like DailyMail Follow DailyMail Follow @dailymail Follow DailyMail Follow MailOnline Follow Daily Mail Get the Sports News RSS feed RSS My Yahoo! Feedly More RSS feeds... Stars of sport \'Are you taking the p***?!\': Brandon Williams\' dad is left STUNNED as Utd starlet hands him the keys to new 40,000 Mercedes Repaying his faith Make the FA Cup like the World Cup! Jamie Carragher leads calls to change cup format amid coronavirus pandemic Ex-Liverpool man wants big changes made EXCLUSIVE: \'My God, can he play or what...\' Harry Redknapp tells the story of seeing James Maddison play for the first time Harry was impressed AC Milan and rivals Inter given green light to te