... Arsene Wenger hated visiting \'rugby team\' Stoke City so much he complained to the FA about grass length and... PSG pay tribute to their former France U20 youngster Jordan Diakiese, who was tragically found dead aged... \'I would love to see it rescheduled to resemble the World Cup\': Jamie Carragher calls for radical shake up... N\'Golo Kante is the shy, unassuming World Cup winner with a tragic backstory... he has every right to sit... \'I want to stay here!\': Arturo Vidal to dig heels in at Barcelona as midfielder insists he is \'very happy... LaLiga still hoping to re-start season in just THREE WEEKS despite latest report throwing opening Sevilla vs... It\'s football\'s answer to the Inbetweeners... and Liverpool\'s chairman is at the helm! Tom Werner \'heavily... \'I was a d***head to my players\': Jose Mourinho reveals he told Inter Milan stars they had won the \'Scudetto... Chelsea keeper Kepa Arrizabalaga \'wanted on loan by Valencia\' after being dropped by Frank Lampard and Blues... His father was murdered by jihadi gunmen and after he stood up to Michael Jordan (and got a punch in the... N\'Golo Kante \'to be allowed to miss rest of season by Chelsea if fears over coronavirus continue\' as star... Premier League star\'s girlfriend \'is caught smuggling illegal stun gun and cosh into the UK after arriving... \'Are you taking the p***?!\': Brandon Williams\' dad is left stunned as generous Manchester United starlet... West Ham face fight to keep teenage starlet Jeremy Ngakia as defender turns down 5,000-a-week deal with... Chelsea should pursue Manchester United target and Bayer Leverkusen star Kai Havertz as an \'option\' to... The Berlin derby between Union and Hertha erupted back into life amid smoke and fireworks in November... but... Arsenal and Everton \'in negotiations\' to sign 27m Juventus outcast Adrien Rabiot with French star due to be... MARTIN SAMUEL: Everything that looked wrong at Arsenal WAS wrong... and that includes Unai Emery\'s... 