kina Faso Cape Verde Congo DR Ethiopia Mali Niger Nigeria Togo Zambia Teams Leagues/Cups Fixtures Results Table Transfers On Sky Score Centre Bet More from Football Football Home Alan McInally Bundesliga predictions: Alan McInally tips wins for Bayern Munich and Borussia Dortmund Bundesliga returns for its second round of fixtures after the season was halted due to the coronavirus pandemic Last Updated: 22/05/20 9:33am See who Alan McInally has tipped for victory this weekend Alan McInally gives his verdict on this weekend\'s Bundesliga action as the title race hots up. Bayern Munich maintained their four-point lead at the top of the Bundesliga with a 2-0 away win at Union Berlin last Sunday, while Borussia Dortmund thrashed rivals Schalke in 4-0 in their local derby. Meanwhile, Wolfsburg moved into the European places at the expense of Schalke thanks to a last-gasp winner at Augsburg. Bundesliga table | Results | Fixtures Bundesliga return: What did we learn? Bundesliga scout report: \'Havertz hype is real\' Bruno Labbadia got off to a winning start as manager of Hertha Berlin in a convincing victory at Hoffenheim, while Werder Bremen\'s woes continued with a 4-1 home defeat to Bayer Leverkusen. As a result, they stay in 17th place, one point above Paderborn at the foot of the table. McInally, a former Bayern striker, gives us his predictions for the weekend\'s games... Wolfsburg 1-3 Borussia Dortmund (12/1 with Sky Bet) It was difficult for Wolfsburg at Augsburg, but Daniel Ginczek got the winner in the end. It was a tight game, but Wolfsburg were always the better team. Renato Steffen got the other goal, so to go and get a result at Augsburg was impressive. Augsburg will not go down, but were in 14th, so Dortmund will be a different proposition. They are in pole position for the last European spot, but Freiburg, Schalke and Hoffenheim are chasing behind. Wolfsburg will be licking their lips with Dortmund coming to town. Dortmund are odds-on, and I would not say for sure that Dortmund will cruise this. Both teams will score. Raphael Guerreiro scored two and was excellent, as was Julian Brandt and Thorgan Hazard. Brandt was probably the player of the weekend for me and impressed massively. Erling Haaland scored once again and he thinks he is going to score every game! Haaland scored Dortmund\'s first against Schalke Marco Reus looks as though he is definitely out for the season and Dan-Axel Zagadou is still out, so Mats Hummels will be at the heart of a back three, with Lukasz Piszczek and Manuel Akanji either side. They looked pretty solid against Schalke, who were not at the races. I think Wolfsburg will have a goal in them, but whether they can cope with the free-flowing pace of Dortmund will be another thing. It was weird to watch with no crowd, but psychologically they have had weeks to deal with the fact there is and will not be any fans. It sounds weird and you can hear their shouts, but the weekend went well. Others may not enjoy it, but if they do not, do they like football in the first place? Super 6: Too hot to handle? Borussia Dortmund can again close the gap at the top to just one point before Bayern play at 5:30pm, with 88 per cent of Super 6 entrants expecting Dortmund to take home the points, despite Wolfsburg sitting inside the top six. Play for free, entries by 2:30pm. Report: Bayern make winning return Report: Havertz double inspires Leverkusen Alphonso Davies\' incredible rise to the top Bayern Munich 2-0 Frankfurt (8/1 with Sky Bet) Bayern will be delighted to be back at their home ground. Robert Lewandowski got another goal in their win over Union and we are talking about Cristiano Ronaldo and Lionel Messi figures in all competitions for him. Bayern have scored 50 goals in their last 16 games, and that is largely down to Lewandowksi. Benjamin Pavard scored the second with a header to seal it. Lewandowski celebrates after putting Bayern ahead at Union from the spot They brushed Union aside in the end, but Manuel Neuer still had to make a couple of saves. Bayern are not rock solid at the back and will give you chances. Neuer has signed a new contract until 2023 and the back line will continue to have one of the best goalkeepers in the world behind them. Frankfurt were very poor against Borussia Monchengladbach. Some of their best results have come against the top six sides, but Bas Dost needs to start scoring - Andre Silva came on to get a goal too. Their form has not been great and that will continue here. Adolf Hutter will juggle the pack. Bayern were pretty good and they know they are being chased, not by Dortmund, but the other three behind them as well. They must get a result before they go to Dortmund on Tuesday in a massive game. No player in Europe\'s top five leagues is close to Robert Lewandowski\'s goal total Super 6: Three\'s a crowd? Over 37 per cent of Super 6 entrants are backing Bayern to win 3-0 against Frankfurt in Saturday\'s Super 6 round. What score will take your fancy, with 50,000 up for grabs? Play for free, entries by 2:30pm. Report: Dortmund thrash Schalke Round-up: Leipzig lose ground in title race Enter your Super 6 predictions for a chance to win 50,000 Borussia Monchengladbach 2-1 Bayer Leverkusen (9/1 with Sky Bet) The result at the weekend was a cracker for Monchengladbach. They came out of the traps and put the game to bed early doors. They are sitting in third, two wins behind Bayern. If they can get a result against Leverkusen, it will put them in a great position ahead of Bayern\'s match against Frankfurt. Alassane Plea put Monchengladbach ahead against Frankfurt last weekend That being said, Leverkusen scored four on Monday and I will mention the man in the spotlight. Kai Havertz is only 20 and he is a goal machine, while being a presence in the air. Michael Ballack is pleading with him to stay another year, to make sure he progresses his own game. Gladbach\'s defence is one of the finest in the league, with Matthias Ginter one to look out for. He has been fantastic for them this campaign. It will be difficult for Leverkusen to have things their own way. I would not be surprised if Havertz is on the scoresheet in this one, in what will be one of the games of the weekend. Super 6: Sit on the fence? With just two points and two places in the table separating these sides, it seems even the predictions are to close to call. A healthy 42 per cent of Super 6 players are backing a home win, with 30 per cent hoping for a draw between the two. Who will you side with? Play for free here. Alan\'s Super 6 Predictions Wolfsburg 1-3 Borussia Dortmund (12/1 with Sky Bet) Bayern Munich 2-0 Frankfurt (8/1 with Sky Bet) Borussia Monchengladbach 2-1 Bayer Leverkusen (9/1 with Sky Bet) Freiburg 3-0 Werder Bremen (20/1 with Sky Bet) Also See: Bundesliga fixtures Bundesliga results Bundesliga table Paderborn 1-2 Hoffenheim (8/1 with Sky Bet) Schalke 2-1 Augsburg (8/1 with Sky Bet) Play Super 6 for free here Super 6: Dortmund to keep heat on Bayern? Super 6 is back. Do not miss your chance to land the 50,000 jackpot. Play for free, entries by 2:30pm. Trending 1 Ancelotti: Zidane changed my ideas on football 2 Pippen \'beyond livid\' with Jordan over Last Dance 3 Barton feels sorry for Sunderland over play-offs 4 Who is the PL\'s greatest wonderkid? 5 PSG bid 44.7m for Inter striker Icardi 6 Neville: Premier League should save EFL clubs 7 Mourinho: I was unselfish when Inter won CL 8 Was Vettel \'burnt out\' at Ferrari? 9 Chisora: I\'ll help to plot Whyte\'s downfall 10 Liverpool chairman: It\'s important to finish PL season Video Latest News Home Sports Football F1 Cricket Rugby Union Rugby League Golf Boxing Olympics Tennis Racing Darts NFL NBA Netball GAA MMA More Sports Scores Video TV Sky Bet Games More Transfer Centre Live on Sky Get Sky Sports TV Shows TV Guide Competitions Sky Go Now TV Sports Scholarships Tackling Racism Podcasts Mobile Twitter Facebook Contact Us Terms & Conditions Twitter Facebook Sky Sports Get Sky Sports Sky Sports Apps Sportinglife.com TEAMtalk.com Football365.com Partners Sky Bet Fantasy Football Super 6 Living for Sport Planet Rugby Golf365 Planet F1 Cricket365 Sky Sports Channels Sky Sports Main Event Sky Sports Premier League Sky Sports Football Sky Sports Cricket Sky Sports Golf Sky Sports Racing Sky Sports F1 Sky Sports Action Sky Sports Arena Sky Sports News Sky Sports Mix More Sky Sites Sky.com Sky News Sky Corporate Sky For Businesses Now TV Sky Communal TV Sky Academy Bigger Picture Store Locator Work for Sky Advertise With Us Sky TV Accessories Terms & Conditions Privacy & Cookies Notice Privacy Options Accessibility Information Contact Us 2020 Sky UK We would like your feedback, please fill in our survey', 'See who Alan McInally has tipped for victory this weekend\n\nHaaland scored Dortmund\'s first against Schalke\n\nLewandowski celebrates after putting Bayern ahead at Union from the spot\n\nNo player in Europe\'s top five leagues is close to Robert Lewandowski\'s goal total\n\nAlassane Plea put Monchengladbach ahead against Frankfurt last weekend\n\n', 'https://e0.365dm.com/20/05/768x432/skysports-werder-bremen-bayer-leverkusen_4993557.jpg?20200518212244\n\nhttps://e2.365dm.com/20/05/768x432/skysports-erling-haaland_4991813.jpg?20200516151204\n\nhttps://e2.365dm.com/20/05/768x432/skysports-robert-lewandowski_4992702.jpg?20200517174916\n\nhttps://e2.365dm.com/20/05/768x432/skysports-robert-lewandowski_4992809.jpg?20200517201057\n\nhttps://e2.365dm.com/20/05/768x432/skysports-alassane-plea-borussia-monchengladbach_4994457.jpg?20200520072539\n\n', NULL, 1);
INSERT INTO `pages` (`id`, `url`, `title`, `h1`, `h2`, `h3`, `h4`, `h5`, `h6`, `body`, `alt`, `meta`, `words`, `indexed`) VALUES
(46, 'https://bleacherreport.com/articles/2892761-7-ligue-1-players-who-could-be-on-the-move-this-summer', '7 Ligue 1 Players Who Could Be on the Move This Summer | Bleacher Report | Latest News, Videos and Highlights', '7 Ligue 1 Players Who Could Be on the Move This Summer Related', '', 'Report: PSG Make $65M Bid for Icardi Report: PSG Make $65M Bid for Icardi Potential Premier League Bargains  Potential Premier League Bargains  Report: Pjanic Told PSG \'I Only Want Barca\' Report: Pjanic Told PSG \'I Only Want Barca\' Is Ferguson Football\'s Closest Thing to Jordan? Is Ferguson Football\'s Closest Thing to Jordan?', '', '', '', 'Bleacher Report Logo NFL NBA CFB World Football MLB NHL CBB MMA WWE Golf Tennis Boxing B/R Shop More Shows B/R Kicks B/R Live Mag Get the App B/R Shop Sign Up Login Facebook Logo Twitter Logo Copy Link Icon Ligue 1 7 Ligue 1 Players Who Could Be on the Move This SummerTom Williams@tomwfootball Twitter LogoSpecial to Bleacher ReportMay 21, 202014 Comments Comment Bubble Icon B/R No other major European league depends on transfer income as heavily as Ligue 1, and the financial impact of the coronavirus pandemic is likely to further entrench that trend. Clubs in the French top flight earned 635 million from player sales in the 2018-19 season (down from 840 million the previous season), and with revenue streams being slashed left, right and centre during the current crisis, it has become an even more precious income source than before. Although it remains to be seen exactly how the COVID-19 outbreak will affect the transfer market, clubs from around Europe will already be sizing up the best talent in Ligue 1. Featuring the thoughts of a former Ligue 1 scout from a major Premier League club, here are seven players who could find themselves in pastures new by the end of the summer. Thomas Meunier, 28, Right-Back, Paris Saint-Germain DeFodi Images/Getty Images If Paris Saint-Germain are able to play their Champions League quarter-final at some point in the coming months, there is no guarantee that Thomas Meunier will be in their starting lineup when they do. A 2016 signing from Club Brugge, the Belgium international will be out of contract at the end of June, and there seems no prospect of his deal being extended. He has failed to convince PSG coach Thomas Tuchel of his worth during the two years that they have worked together, and while Meunier has repeatedly declared that he wants to stay at the Parc des Princes, he is also confident that he will not be short of offers if he does leave. \"A 28-year-old player, who\'s out of contract, who\'s free, who\'s an international in the world\'s number one team [according to the latest FIFA rankings], it can\'t be a bad deal,\" Meunier said during an Instagram Live interview with Belgian broadcaster RTBF in April. \"In terms of the investment, even if I develop gangrene and they have to cut off one of my legs, they won\'t have much money to lose.\" An avowed Anglophile, Meunier grew up supporting Manchester United and has been reading Peter Crouch\'s autobiography during lockdown. He has regularly been linked with a move to the Premier League, and with few international-class right-backs on the market, this summer could be the time for him to finally cross the Channel. The scout\'s view: \"I\'m surprised and not surprised that PSG don\'t want to keep him. Surprised because he\'s 28, he\'s a Belgium international and he\'s been effective in some of their biggest games. But I\'m not surprised because if they want to go to the next level, PSG probably feel they need to have a better player in that position. I think he\'d be a good option for a Premier League club, particularly as he\'s free.\" Victor Osimhen, 21, Striker, Lille Michel Spingler/Associated Press Lille have mastered the art of buying low and selling highas demonstrated by Nicolas Pepe\'s 72 million transfer to Arsenal last yearand Victor Osimhen looks set to become the latest player to walk that well-trodden path. Signed from Charleroi for a reported fee of 12 million last July, Osimhen burst on to the scene in France with a brace on his debut against Nantes and went on to score 18 goals in all competitionsincluding strikes against Chelsea and Valencia in the Champions Leaguebefore the French season was curtailed. A blisteringly quick and explosive striker, Osimhen has been linked with some of the biggest clubs in Europe and has reportedly been the subject of a 76 million bid from an unnamed suitor, per Telefoot. While Lille president Gerard Lopez vowed on RTL in February (h/t RMC) that \"Osimhen will be a Lille player next season,\" a hefty bid would seriously test the club\'s resolve. The Nigeria international, who grew up in abject poverty in Lagos, has expressed an ambition to play in the Premier League, but at this stage of his career, he is not prepared to sit on the bench. \"My priority is to play a lot of games,\" Osimhen told The Independent last month. \"Signing for a big club and being on the bench is not exciting for me.\" The scout\'s view: \"Osimhen\'s main traits are that he\'s quick and he\'s shown that he can score goals. You can compare him to someone like Pierre-Emerick Aubameyang. Like Aubameyang, he needs to find a team that will suit his way of playing. I think he\'ll have a move because Lille want to sell him and their business plan is based on selling players.\" Axel Disasi, 22, Centre-Back, Reims FRANCK FIFE/Getty Images It does not take too much imagination to picture reported Arsenal target Axel Disasi in the north London club\'s coloursand not only because Reims play in the same red shirts and white sleeves as his potential future employers. Disasi, who turned 22 in March, got his big break at Reims last summer when Bjorn Engels left the club to join Aston Villa. Drafted into central defence alongside the experienced Yunis Abdelhamid, Disasi helped to turn the side from champagne country into the most formidable defensive unit in France, with only 21 goals conceded over the course of the curtailed Ligue 1 campaign. Tall and powerfully built, the dreadlocked Disasi is a front-foot defender who relies on his sense of anticipation to attack the ball in the air and on the ground. Although he has a tendency to dive into tackles, his physicality and authoritative playing style have prompted comparisons with Chelsea\'s Kurt Zouma. Once in possession, he tends to keep things simple, but he is fond of hitting across the ball with his right foot to send long raking passes up the pitch. The France under-20 international has been linked with Arsenal and Monaco and is reportedly being tracked by a number of leading German clubs, per Goal. L\'Equipe reported in April that he will be allowed to leave Reims if the club receive a \"suitable offer.\" The scout\'s view: \"From my point of view, there\'s been a lot of talk about him. He only has one year left on his contract, and Reims want to sell him for as much money as they can. He\'s performed well this season, but I don\'t think he\'s a top centre-back. I have doubts about him.\" Stephane Ruffier, 33, Goalkeeper, Saint-Etienne Jean Catuffe/Getty Images Had the season panned out as Stephane Ruffier would have hoped, he would be closing in on his 400th appearance for Saint-Etienne. But those ambitions hit the skids even before the coronavirus outbreak brought the season to a premature conclusion. With Saint-Etienne struggling towards the bottom of the Ligue 1 table, manager Claude Puel elected to drop Ruffier for a home game against Reims in late February in favour of perennial back-up goalkeeper Jessy Moulin. Ruffier\'s agent, Patrick Glanz, was outraged, accusing Puel in L\'Equipe of \"spitting on a Saint-Etienne legend,\" and matters have scarcely improved since. Puel confirmed recently that Moulin will remain his first-choice goalkeeper next season and indicated that the club would consider offers for Ruffier. \"Stephane still has a year left on his contract, and I\'ll respect his decision,\" Puel told regional newspaper Le Progres. \"If he so wishes, we\'ll look at whichever possibilities present themselves.\" The shaven-headed Ruffier joined Saint-Etienne from 2011 and has made 315 top-flight appearances for the club, which is more than any other goalkeeper in Les Verts\' history. Renowned for his consistency, he possesses spectacular goal-line reflexes, although he does not dominate his penalty area and is not completely at ease with the ball at his feet. Capped three times by France, Ruffier would suit a club looking for some experience and reliability between the posts. The scout\'s view: \"I don\'t see him going to a top club. He\'s not that tallhe\'s only 1.88m (6\'2\"). Most clubs in England, for example, would like a very tall goalkeeper. He\'s already 33, so there\'d be no return on the investment in this kind of player. And I\'m not sure how he would adapt [to a new league]. But he has one of the biggest salaries at Saint-Etienne and he only has one year left on his contract. Saint-Etienne are struggling for money, so they\'re not going to let him go for free [in 2021].\" Ibrahima Diallo, 21, Defensive Midfielder, Brest FRED TANNEAU/Getty Images Ibrahima Diallo is still to play a full campaign of top-level football, but he made a striking impression in his first half-season in Ligue 1 with Brest. France Football magazine picked Diallo to anchor the midfield in its \"Nice Surprises\" team of the season\'s first half and described the former Monaco youth-team player as \"one of the revelations of the start of the season.\" Diallo, who is the younger brother of PSG centre-back Abdou Diallo, is an all-action defensive midfielder who has been likened to N\'Golo Kante. Prior to being sidelined by a hamstring injury at the end of January, he had generally played alongside Haris Belkebla in a midfield two, but he has also been deployed as a solitary holding midfielder in a 4-3-3 formation. Capped by France at under-20 level, according to Brest On Air, Diallo was linked with a move to Leicester City in January and is reportedly being tracked by Everton, Sevilla and Nice, per L\'Equipe. In an interview with Ultimo Diez, he cited the Premier League and the Bundesliga as two leagues he would like to play in, and at Brest, there is an acceptance that he will not be playing at Stade Francis-Le Ble forever. \"He\'s a mature and grounded boy,\" Brest coach Olivier Dall\'Oglio said in March. \"It\'s not surprising that clubs more glamorous than Stade Brestois have been coming to find out about him.\" The scout\'s view: \"There\'s a question mark over him, for me. But let\'s see. He and his brother didn\'t come from the Paris area, so they\'ve not had to fight in the same way. Nampalys Mendy was also compared to N\'Golo Kante when he came from Nice and look what happened there. Could he cope with the standards in the Premier League? Every week is a battle.\" Morgan Sanson, 25, Central Midfielder, Marseille Sylvain Lefevre/Getty Images With Marseille facing financial fair play sanctions from UEFA after racking up cumulative losses of 170 million between 2017 and 2019, they will find it difficult to turn down bids for their star players this summer, even with a Champions League campaign to prepare for. Three-and-a-half years after arriving from Montpellier, midfielder Morgan Sanson is seen as one of the players most likely to help Marseille hit their target of 60 million in incoming transfer fees. A box-to-box midfielder with an excellent first touch, a good engine and an eye for goal, the former France under-21 international was a virtual ever-present in 2019-20 as OM unexpectedly secured a return to the Champions League. \"He\'s a creator,\" Sanson\'s Marseille team-mate Boubacar Kamara told the Ligue 1 website earlier this year. \"He has lots of character and covers lots of ground. It\'s like he has three lungshe makes runs from the first minute to the last.\" Per L\'Equipe, Sanson has been linked with several Premier League clubs, including Arsenal, Tottenham Hotspur, Everton and West Ham United, and has reportedly engaged the services of Israeli super-agent Pini Zahavi to help him find a club in England. The scout\'s view: \"Would Morgan Sanson suit the style of play of an English club? I don\'t know. He\'d need a Latin coachsomeone like Mikel Arteta at Arsenal. He has good technical abilities, but on a physical level, he might find playing in the Premier League difficult.\" Serhou Guirassy, 24, Striker, Amiens Soccrates Images/Getty Images Like Marseille, Amiens are another club in need of funds, although in their case it is because of their bitterly contested demotion to Ligue 2 following the curtailment of the Ligue 1 season. Having scored nine times in 23 matches, including a coolly taken brace in a 4-4 draw against PSG in February, Serhou Guirassy takes pride of place in the club\'s shop window. Something of an old-fashioned target man, Guirassy is tall and strong and excels with his back to goal, making him a useful out-ball. His ability to shield the ball makes him particularly adept at winning free-kicks, and out of all the forwards who played in Ligue 1 this season, only PSG\'s Neymar and Bordeaux\'s Nicolas de Preville suffered more fouls per 90 game than the Amiens No. 9 (2.7, per WhoScored). Guirassy, who previously spent two-and-a-half years at Cologne, has been linked with Arsenal, Chelsea Tottenham and West Ham, per Metro. He is represented by London-based French agent Moussa Sissoko, whose clients include Barcelona\'s Ousmane Dembele and Rennes starlet Eduardo Camavinga. \"We have an arrangement with Serhou,\" Amiens president Bernard Joannin told L\'Equipe\'s television channel in May. \"He had some really significant offers from English clubs. He wanted to stay in order to save the clubthat\'s what he told me. He wanted to finish the story with his team-mates. We have significant offers from England and France.\" The scout\'s view: \"He\'s performed well this season and is physically strong. I think he would do well in England. He could perform for a Premier League club. I think he\'s ready because he\'s already played abroad, at Cologne. He\'ll be more prepared to succeed if he goes to a foreign country again.\" Facebook Logo Twitter Logo Copy Link Icon Related Report: PSG Make $65M Bid for Icardi Inter want $75M, with talks ongoing World Football Report: PSG Make $65M Bid for Icardi Sky Sportsvia Sky Sports Potential Premier League Bargains   B/R names 5 lower league talents  Expert recommends ideal clubs  Who is the next unearthed gem? World Football Potential Premier League Bargains  Sam Tighevia Bleacher Report Report: Pjanic Told PSG \'I Only Want Barca\' Juve midfielder turned down \'attractive\' PSG offer World Football Report: Pjanic Told PSG \'I Only Want Barca\' Edvia PSG Talk Is Ferguson Football\'s Closest Thing to Jordan? World Football Is Ferguson Football\'s Closest Thing to Jordan? via men Bleacher Report Logo Facebook Logo Twitter Logo Instagram Logo About Advertise Contact Us Careers Community Guidelines Privacy Cookie Preferences Terms Of Use Tickets AdChoices Copyright  2020 Bleacher Report, Inc. Turner Broadcasting System, Inc. All Rights Reserved. BleacherReport.com is part of Bleacher Report  Turner Sports Network, part of the Turner Sports and Entertainment Network. Certain photos copyright  2020 Getty Images. Any commercial use or distribution without the express written consent of Getty Images is strictly prohibited. AdChoices Turner Logo', 'Ligue 1 logo\n\nLille\'s Nigerian forward Victor Osimhen celebrates scoring his team\'s first goal during the French L1 Football match between Angers SCO and Lille (LOSC), at Raymond-Kopa Stadium, in Angers, northwestern France on Febuary 07, 2020. (Photo by JEAN-FRANCOIS MONIER / AFP) (Photo by JEAN-FRANCOIS MONIER/AFP via Getty Images)\n\nDORTMUND, GERMANY - FEBRUARY 18: (BILD ZEITUNG OUT) Thomas Meunier of Paris Saint-Ger