be to Independent Premium. View offers Hi {{fullName}} My Independent Premium Account details Help centre Logout Tom Peck @tompeck Tom Peck is The Independent\'s Political Sketch Writer. He has also worked as a Political Correspondent, Sports Writer and Olympics Correspondent. Voices Saving Boriss life wont get you out of the 624 NHS surcharge It somehow doesnt feel quite right that we can clap for care workers on a Thursday night then slap them with a bill right after Voices Matt Hancocks protective ring around care homes does not exist The trouble with claiming youve safeguarded these facilities from the start is that 20,000 people have now died inside them Voices The virtual parliament was a clear success so it must be ended at once Tom Peck Voices This is Boris Johnsons most embarrassing PMQs performance yet Tom Peck Voices With all hes dodged, Sunak is the Tories Neo from The Matrix Tom Peck Voices What if Boris Johnson isnt just lazy? What if he really is this bad? Tom Peck Voices Johnson says he has a clear plan. The downside is it makes no sense Tom Peck UK news Coronavirus hasnt changed Britain but it has reminded us what matters Tom Peck Voices PMQs doesnt need Starmer to show Boriss inadequacy, but it helps Tom Peck Voices Coronavirus should have hastened urgent questions about China Tom Peck Voices We are past the peak, says Boris, but it neednt have been so high Tom Peck Voices Priti Patel has left it too late to keep Johnny Foreigner out Tom Peck Voices Johnson thinks weve been successful  the death toll says otherwise The prime minister is right, coronavirus is a mugger. The way to deal with it is to cross the road when you see it coming, not bound up to it and shake it by the hand Voices While Trump spouts misinformation, his peers stand idly by If Trumps advisors had had the temerity to say words to the effect of No you shouldnt drink bleach, we wouldnt be in this mess Voices Is Matt Hancock being lined up to be the coronavirus fall guy? Voices With so much taxpayer cash to spend, why are MPs second home so bad? Voices The House of Commons was too slow to close, but is right to return Voices The government cant fight Covid-19 so its fighting the media instead Baby Tech & Essentials Is the wifi-enabled Snoo baby cot worth the 1,000 price tag? Voices Matt Hancock has zero answers, but he does have a six-point plan Tom Peck Voices Dominic Raab confirmed the grim news: three more weeks of Dominic Raab Tom Peck Health Nightingale hospital diverts equipment from Londons struggling ICUs Voices Matt Hancocks badge for carers is too little, too late Tom Peck Voices The government has been led by the science  so how did we get here? Tom Peck Voices 16 days and the government still cant answer one coronavirus question Tom Peck Voices We wish Classic Dom all the very best. There is no war without him Tom Peck Voices A chance at ventilators somehow ended up in Johnsons spam folder Tom Peck Voices Might we actually emerge from coronavirus with better politics? Tom Peck Voices NHS staff who have lost their lives deserve better than this Tom Peck Voices Enter Alok Sharma, stage four of the government\'s coronavirus plan Tom Peck Voices Farewell Jeremy Corbyn, its your country now Tom Peck Voices Matt Hancock has offered the NHS a salute. I think they\'d prefer masks Tom Peck Voices Don\'t mock the panic-buyers in Asda. Ask why Johnson lost their trust Tom Peck Voices Whatever coronavirus brings, you can rely on Johnson to play the fool Tom Peck Voices The Covid-19 emergency powers will be around long after the outbreak Tom Peck Voices Coronavirus should have forced parliament to shut down a week ago Tom Peck Voices Sunak is the star of the latest coronavirus show from the government Voices At this most desperate hour, Britain needs better than Boris Johnson Tom Peck Voices The plan worked  Johnson said carry on and now were in lockdown Tom Peck Voices Yes, people will die, says Boris  just keep calm and carry on Tom Peck Voices Money no longer matters, not now Rishi Sunak wants to get it done Tom Peck Voices Coronavirus will most harm those who work, not type, for a living Tom Peck Voices If No 10s fake news unit is any good, it will shut itself down Tom Peck Voices The bridge to N Ireland is now a tunnel. No matter  it wont be built Voices No Boris, will you be changing any nappies? is not a tough question Voices Americas next president will be an old, white man Voices Mutant superbug government cannot control  Johnson or coronavirus? Tom Peck Voices Who to believe  national security danger Patel, or the other guy? Tom Peck Voices How could coronavirus affect Matt Hancocks career? Tom Peck Voices Boris Johnson\'s \'oven ready\' Brexit is about to be served up raw Tom Peck Voices Move over, Corbyn, theres a new opposition in the house  Sajid Javid Tom Peck Voices Keir Starmers performance has gone from hopeful to utterly hopeless Tom Peck Voices Racist is not a word to use lightly, but Boris Johnson is one Tom Peck Voices The only thing eugenics works for is delusional white men Tom Peck Voices In this shambolic cabinet, Suella Braverman fits right in Tom Peck Voices Boriss gain is our loss  we now have a stooge for chancellor Tom Peck Voices Dominic Cummings empire is crumbling, and taking us all down with it Tom Peck Voices Of course Johnson has given HS2 the green light  he loves antiquity Tom Peck Voices Boris\' bridge will link a unified Ireland with an independent Scotland Voices Im with Trump  he was right to lose it with Boris over Huawei Voices Can nothing Trump does shock America anymore? Voices It took one question for the ground to collapse beneath Nicky Morgan Tom Peck Voices This journalist-banning government failed to defend the indefensible Tom Peck Voices Theres no use in Johnson trying to bring us out and into the world Tom Peck Voices Parliament Square was a knuckle-dragging carnival of stupidity Tom Peck Voices Brexit has already started to fall apart  as has the US 