(49, 'https://www.skysports.com/football/news/11860/11992630/jose-mourinho-i-was-unselfish-when-inter-milan-won-champions-league', 'Jose Mourinho: I was unselfish when Inter Milan won Champions League | Football News | Sky Sports', 'Jose Mourinho: I was unselfish when Inter Milan won Champions League', 'Football', 'Serie A News When Inter Milan stunned Barcelona Also See: Super 6: Dortmund to keep heat on Bayern? Trending', '', 'More from Football', '', 'Search Football Serie A Inter Milan News News News Select a team All Teams Arsenal Aston Villa Bournemouth Brighton Burnley Chelsea Crystal Palace Everton Leicester City Liverpool Manchester City Manchester United Newcastle United Norwich City Sheffield United Southampton Tottenham Hotspur Watford West Ham United Wolverhampton Barnsley Birmingham City Blackburn Rovers Brentford Bristol City Cardiff City Charlton Athletic Derby County Fulham Huddersfield Town Hull City Leeds United Luton Town Middlesbrough Millwall Nottingham Forest Preston North End Queens Park Rangers Reading Sheffield Wednesday Stoke City Swansea City West Bromwich Albion Wigan Athletic Accrington Stanley AFC Wimbledon Blackpool Bolton Wanderers Bristol Rovers Burton Albion Coventry City Doncaster Fleetwood Town Gillingham Ipswich Town Lincoln City Milton Keynes Dons Oxford United Peterborough United Portsmouth Rochdale Rotherham United Shrewsbury Town Southend United Sunderland Tranmere Rovers Wycombe Wanderers Bradford City Cambridge United Carlisle United Cheltenham Town Colchester United Crawley Town Crewe Alexandra Exeter City Forest Green Rovers Grimsby Town Leyton Orient Macclesfield Town Mansfield Morecambe Newport County Northampton Town Oldham Athletic Plymouth Argyle Port Vale Salford City Scunthorpe United Stevenage Swindon Town Walsall Aberdeen Celtic Hamilton Academical Heart of Midlothian Hibernian Kilmarnock Livingston Motherwell Rangers Ross County St Johnstone St Mirren Athletic Bilbao Atletico Madrid Barcelona CD Leganes Celta V