ague title in 2010 Jose Mourinho says his unselfishness was the key to Inter Milan winning the Champions League title 10 years ago today. In Madrid on May 22, 2010, Mourinho\'s Inter beat Bayern Munich 2-0 to complete a treble - including Serie A and the Coppa Italia - and become only the fifth manager in history to win Europe\'s top club competition with two different clubs. Having already collected two pieces of silverware that season, the Portuguese coach said the deciding factor in beating Bayern was that he was solely focused on how important it was to his players - not to himself. When Inter Milan stunned Barcelona The story of the night Jose Mourinho\'s Inter shocked Pep Guardiola\'s Barcelona in 2010 \"In the final against Bayern Munich, there hasn\'t been a single moment when I thought about myself,\" Mourinho, the current Tottenham Hotspur manager, told Sky Sports News. \"I never thought \'if we win, I will get my hands on my second Champions League\'. I never thought \'if we lift the cup, I will win the FIFA Manager of the year\". I never thought about myself. My mind was always fully focused on bringing joy to others. \"For me it was all about the meaning that the cup had for chairman Massimo Moratti, for club captain and legend Javier Zanetti, for all the players, for the fans. For me it was all about being unselfish. I could not be selfish. Also See: Latest Tottenham transfer rumours Who is the PL\'s greatest wonderkid? Mourinho says it was more important to win the Champions League for people such as Inter chairman Massimo Moratti than for himself \"That is why I felt so special. I felt special because even though it was a very important moment in my carreer too, I managed to keep being humble and calm. I was paying more attention to others\' reactions than mine. It was a beautiful feeling because these guys had this effect and power on me. \"I have heard them many times saying I was very important to them, leaving a lifetime mark in their personal experiences. But I want to see it in another way. They were the ones, important to me.\" Super 6: Dortmund to keep heat on Bayern? Super 6 is back. Do not miss your chance to land the 50,000 jackpot. Play for free, entries by 2:30pm. Trending 1 Ancelotti: Zidane changed my ideas on football 2 Pippen \'beyond livid\' with Jordan over Last Dance 3 Barton feels sorry for Sunderland over play-offs 4 Who is the PL\'s greatest wonderkid? 5 PSG bid 44.7m for Inter striker Icardi 6 Neville: Premier League should save EFL clubs 7 Mourinho: I was unselfish when Inter won CL 8 Was Vettel \'burnt out\' at Ferrari? 9 Chisora: I\'ll help to plot Whyte\'s downfall 10 Liverpool chairman: It\'s important to finish PL season Video Latest News Home Sports Football F1 Cricket Rugby Union Rugby League Golf Boxing Olympics Tennis Racing Darts NFL NBA Netball GAA MMA More Sports Scores Video TV Sky Bet Games More Transfer Centre Live on Sky Get Sky Sports TV Shows TV Guide Competitions Sky Go Now TV Sports Scholarships Tackling Racism Podcasts Mobile Twitter Facebook Contact Us Terms & Conditions Twitter Facebook Sky Sports Get Sky Sports Sky Sports Apps Sportinglife.com TEAMtalk.com Football365.com Partners Sky Bet Fantasy Football Super 6 Living for Sport Planet Rugby Golf365 Planet F1 Cricket365 Sky Sports Channels Sky Sports Main Event Sky Sports Premier League Sky Sports Football Sky Sports Cricket Sky Sports Golf Sky Sports Racing Sky Sports F1 Sky Sports Action Sky Sports Arena Sky Sports News Sky Sports Mix More Sky Sites Sky.com Sky News Sky Corporate Sky For Businesses Now TV Sky Communal TV Sky Academy Bigger Picture Store Locator Work for Sky Advertise With Us Sky TV Accessories Terms & Conditions Privacy & Cookies Notice Privacy Options Accessibility Information Contact Us 2020 Sky UK We would like your feedback, please fill in our survey', 'Jose Mourinho made history when he took Inter Milan to the Champions League title in 2010\n\nMourinho says it was more important to win th