e Rooney and Raheem Sterling make our shortlist, but who is the greatest Premier League wonderkid? Last Updated: 22/05/20 1:22pm 5:03 Top 10 Premier League wonderkids Top 10 Premier League wonderkids There have been a number of precocious talents that have graced the Premier League over the past 28 seasons, from Robbie Fowler to Raheem Sterling. Those who have broken into the first team as young teenagers haven\'t always fulfilled their potential but our esteemed list of 10 were always destined for distinguished careers having burst onto the scene. Michael Owen\'s greatest PL goals PL Goals of the Season: 1999/2000 Raheem Sterling is the youngest player to score a Premier League goal at Anfield, doing so at 17 years and 317 days against Reading in October 2012. Robbie Fowler scored more Premier League goals before turning 21 than any other player in the competition\'s history (64). Then there is Gareth Bale, who remains the most expensive British player in Premier League history following his 2013 transfer to Real Madrid from Tottenham. Gareth Bale lit up White Hart Lane during his time as a Tottenham player Nicolas Anelka also makes our shortlist, the only player in Premier League history to net more than 20 goals with four different clubs (Arsenal, Bolton, Chelsea, Manchester City). No list would be complete without Wayne Rooney, who scored 183 Premier League goals for Manchester United - the most by a player for a single club in the competition\'s history. James Milner holds the current record for the most Premier League games scored in without ever losing (54 Games: W43 D11 L0). The original wonderkid Ryan Giggs assisted a Premier League goal for 45 different team-mates during his career, more than any other player in the competition. Rooney followed in the footsteps of Ryan Giggs as a Premier League wonderkid Included in our list is Michael Owen, the youngest player to reach 100 Premier League goals, doing so aged 23 years and 133 days old. Among those still playing is Dele Alli, one of four players to win PFA young player of the year in back-to-back campaigns alongside Giggs, Fowler and Rooney. Also See: Future star: Grady Diangana Notebook: What next after PL training return? The Insider: Neymar, Ronaldo too big to sell Transfer Centre LIVE! And finally, Cesc Fabregas reached 25 Premier League assists at a younger age than any other player, at just 20 years and 134 days. Now, it\'s your turn... But who on our 10-man shortlist is the greatest Premier League wonderkid in your view? Watch the video above and vote below... Super 6: Dortmund to keep heat on Bayern? Super 6 is back. Do not miss your chance to land the 50,000 jackpot. Play for free, entries by 2:30pm. Trending 1 Ancelotti: Zidane changed my ideas on football 2 Pippen \'beyond livid\' with Jordan over Last Dance 3 Barton feels sorry for Sunderland over play-offs 4 Who is the PL\'s greatest wonderkid? 5 PSG bid 44.7m for Inter striker Icardi 6 Neville: Premier League should save EFL clubs 7 Mourinho: I was unselfish when Inter won CL 8 Was Vettel \'burnt out\' at Ferrari? 9 Chisora: I\'ll help to plot Whyte\'s downfall 10 Arsenal\'s squad assessed: Stay or go? Video Latest News Home Sports Football F1 Cricket Rugby Union Rugby League Golf Boxing Olympics Tennis Racing Darts NFL NBA Netball GAA MMA More Sports Scores Video TV Sky Bet Games More Transfer Centre Live on Sky Get Sky Sports TV Shows TV Guide Competitions Sky Go Now TV Sports Scholarships Tackling Racism Podcasts Mobile Twitter Facebook Contact Us Terms & Conditions Twitter Facebook Sky Sports Get Sky Sports Sky Sports Apps Sportinglife.com TEAMtalk.com Football365.com Partners Sky Bet Fantasy Football Super 6 Living for Sport Planet Rugby Golf365 Planet F1 Cricket365 Sky Sports Channels Sky Sports Main Event Sky Sports Premier League Sky Sports Football Sky Sports Cricket Sky Sports Golf Sky Sports Racing Sky Sports F1 Sky Sports Action Sky Sports Arena Sky Sports News Sky Sports Mix More Sky Sites S