ubscribe to Independent Premium. View offers Hi {{fullName}} My Independent Premium Account details Help centre Logout Clarisse Loughrey Chief film critic @clarisselou Clarisse Loughrey is the chief film critic for The Independent. She also acts as a regular stand-in for Mark Kermode on BBC Radio 5 Lives Kermode and Mayo and runs That Darn Movie Show, a weekly review channel on YouTube. Features Why the Star Wars prequels finally deserve some respect As Revenge of the Sith turns 15, Clarisse Loughrey takes a lightsaber to the hatred it fuelled on the dark side of the internet Culture Clarisse Loughrey BDSM romcom Secretary could teach Fifty Shades of Grey a few lessons The film delivers a purer fantasy, writes Clarisse Loughrey  one that acknowledges sometimes spanking can be the ingredient for a fairy tale romance Culture Audition helped Takashi Miike become the godfather of ultraviolence Clarisse Loughrey Features Why the spectre of Crash still haunts Hollywood, 15 years on Culture Why the horrors of Eyes Without a Face are just as visceral today Clarisse Loughrey Reviews The Assistant exposes the culture of silence around Weinsteins crimes Independent Premium How Blow Out proves that film cant show us the truth Clarisse Loughrey Features The best Al Pacino films, ranked Reviews Chris Hemsworth stars in testosterone-charged fantasy Extraction Reviews Beastie Boys Story tracks the bands creative and moral evolution Culture American Psycho was a canary in the coalmine for the Trump era Clarisse Loughrey Culture How Friday the 13th failed its most subversive villain Clarisse Loughrey Features Amores perros is a primordial stew of pain, desire and rage The next pick in our new weekly film social is Alejandro Gonzalez Inarritus electrifying debut. Clarisse Loughrey explains why the film helped revitalise Mexican cinema Reviews Jackie Chan & Arnold Schwarzeneggers Iron Mask showdown is a dud You expect the ultimate showdown between martial arts and pure Hollywood brawn. What you get is limbs in the wind Reviews Trolls World Tour is hyperactive & glitter-drenched, but not brainless Features How panther-horror Cat People changed cinema forever Reviews Meghan Markle perfects the narration of Disney+ documentary Elephant Reviews Four Kids and It seems made to be consumed and forgotten Features The Indy Film Club picks unlikely romcom Harold and Maude Reviews The Perfect Candidate is a Saudi feminist drama free from poeticism Reviews Claustrophobic horror Vivarium may cut a little too close to the bone Features The 30 best Disney films to watch as Disney+ launches in UK Features Marvel Cinematic Universe films ranked as Disney+ arrives Reviews Lady and the Tramp is a refreshingly humble Disney live-action remake Reviews The Jesus Rolls proves this one-joke Lebowski didnt need his own film Reviews And Then We Danced is giddy with the pleasures of first love Reviews The Hunt is as incomprehensible as Trumps tweets Features The most powerful lines of poetry ever written Reviews Fire Will Come is striking, but its title doesnt offer much hope Independent Premium Catherine Deneuve & Juliette Binoche are a gift to watch in The Truth Clarisse Loughrey Reviews Misbehaviour fails to keep its feminism intersectional Reviews Escape from Pretoria makes an ideal everyman out of Daniel Radcliffe Reviews Pixar has delivered another soul-crushing tearjerker with Onward Reviews Military Wives is an underdog story that hits all the expected notes Reviews Todd Haynes bathes his audience in true-life terror in Dark Waters Reviews Domestic violence is the real terror in The Invisible Man Reviews True History of the Kelly Gang is a hallucinatory take on an legend Reviews Julia Louis-Dreyfus rescues Downhill, the timid Force Majeure remake Reviews Portrait of a Lady on Fire review: Gorgeous and romantic period drama Culture How yesterdays teen idols are escaping their franchise pasts Clarisse Loughrey Reviews Like a Boss is saved by dream team Tiffany Haddish and Rose Byrne Reviews The Call of the Wild is a call back to the thrills of the unknown Reviews Sonic the Hedgehog is like another live-action Alvin and the Chipmunks Reviews To All the Boys: PS I Still Love You is a less confident sequel Reviews EMMA. is a decadent, fondant-swaddled delight Culture Clarisse Loughrey The glorious, messy Oscars was a night of revolutionary wins Reviews Parasite is an intricate examination of class conflict Reviews Birds of Prey has sequin-encrusted girliness & bone-smashing violence Features Birds of Prey is the girl-gang movie Harley Quinn deserves Clarisse Loughrey Reviews Dolittle is flat and hokey, but its certainly no Cats News Comedian Asim Chaudhry mocks Laurence Fox over Sikh solider remarks News Cats star Rebel Wilson mocks her own film at the Baftas Features 4 of the biggest talking points from this years Baftas ceremony News Joaquin Phoenix says hes ashamed by all-white acting Baftas News Sam Mendes 1917 beats Parasite to Best Film in Baftas sweep News Brad Pitt gets Margot Robbie to deliver joke about Brexit at Baftas News Graham Norton references diversity controversy in opening monologue Reviews Uncut Gems features the best performance of Adam Sandlers career Reviews Tom Hanks is perfectly cast in A Beautiful Day in the Neighborhood Reviews The Man Who Killed Don Quixote is wildly out of touch Reviews The Lighthouse review: Horror filled with sweaty desire and rage Reviews Clint Eastwood turns Richard Jewell into a martyr to his cause Reviews The Turning is muddled but not entirely pointless Reviews The Grudge just about escapes the horror sequel doldrums Reviews The Personal History of David Copperfield is a vivacious adaptation Reviews Bad Boys for Life is surprisingly self-reflective Reviews Just Mercy review: Death row drama is refined, sober filmmaking Reviews Malick found a subject worth getting close to in A Hidden Life Reviews Charlize Theron eerily transforms into Megyn Kelly in Bombshell Reviews Kristen Stewarts performance in Seberg deserves a smarter film Reviews 1917 exposes the limitations of immersive filmmaking News The actual lyrics to New Year song Auld Lang Syne Get in touch Contact us Jobs Our products Subscriptions Donations Install our apps Archive Other publications Evening Standard Novaya Gazeta Extras All topics Voucher codes Advertising guide Syndication Legal Code of conduct and complaints Contributors Cookie policy Donations Terms & Conditions Privacy notice User policies', '', '', NULL, 1),
